		obj = new JSONObject("{\"id\":\"5240\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"longueur\":\"2,15\",\"hauteur\":\"2\",\"precision_materiaux\":\"Sapin\",\"materiaux\":\"acier, bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Hiroshi Teshima dépose un stère de bois, soit un mètre cube, sur un petit terre-plein de sable, entre plaine et forêt. Cette composition en forme d'abri allie matière naturelle brute et forme géométrique pour créer un juste équilibre, un point de repère, un lieu. Le cube évidé au centre encadre et dirige le regard, incite à découvrir deux paysages qui se font face et dialoguent : l'un naturel, la forêt ; et l'autre dessiné par l'homme, le champ.\",\"image_principale\":\"Hiroshi_Teshima_Une_fenetre_en_Foret_VdF1997_credit_Marie_Clems-2011-07_(5).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Hiroshi_Teshima_Une_fenetre_en_Foret_VdF1997_credit_Marie_Clems-2011-07_(5).jpg\",\"artiste\":\"Hiroshi Teshima\",\"latitude\":\"48.8949\",\"longitude\":\"5.4287\",\"titre\":\"Une fenêtre en forêt\",\"url\":\"http://publicartmuseum.net/wiki/Une_fen%C3%AAtre_en_for%C3%AAt_(Hiroshi_Teshima)\"}");
