		obj = new JSONObject("{\"id\":\"5239\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"longueur\":\"1,5\",\"hauteur\":\"1,9\",\"precision_materiaux\":\"Branches de Noisetier\",\"materiaux\":\"bois, pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2002\",\"description\":\"Jannecke Lonne Christiansen édifie deux colonnes de pierre blanche sculptées surmontées d'une arche en branches de noisetier entrecroisées, formant comme le porche d'entrée de The Basilica of the Forest, la Basilique de la Forêt. L'arc en plein cintre, inspiré des églises romanes, marque un passage symbolique entre deux espaces, deux univers : celui de l'homme, profane, et celui, sacré, de la forêt.\",\"image_principale\":\"2003_oeuvre_seule_080_Jannecke_Chritiansen_the_basilica_of_the_forest_vdf2002_©Claude_Teter_(4).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_080_Jannecke_Chritiansen_the_basilica_of_the_forest_vdf2002_©Claude_Teter_(4).JPG\",\"artiste\":\"Jannecke Lønne Christiansen\",\"latitude\":\"48.9141\",\"longitude\":\"5.4141\",\"titre\":\"The Basilica of the Forest\",\"url\":\"http://publicartmuseum.net/wiki/The_Basilica_of_the_Forest_(Jannecke_L%C3%B8nne_Christiansen)\"}");
