		obj = new JSONObject("{\"id\":\"5238\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"precision_materiaux\":\"Fil de fer\",\"materiaux\":\"bois, pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Chris Booth édifie au cœur d'un sous-bois un dôme de pierres plates percées et assemblées entre elles. Près de la souche d'un arbre qui a été abattu, les branchages et les brindilles résultant de la coupe sont abrités sous une carapace minérale et spirituelle, un refuge de sérénité où la vie est préservée, respectée.\",\"image_principale\":\"2003_oeuvre_seule_035_Chris_Booth_Terre_Ciel_vdf1999_©Claude_Teter_(3).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_035_Chris_Booth_Terre_Ciel_vdf1999_©Claude_Teter_(3).JPG\",\"artiste\":\"Chris Booth\",\"latitude\":\"48.9227\",\"longitude\":\"5.4207\",\"titre\":\"Terre / Ciel\",\"url\":\"http://publicartmuseum.net/wiki/Terre_%2F_Ciel_(Chris_Booth)\"}");
