		obj = new JSONObject("{\"id\":\"5237\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"precision_materiaux\":\"Eléments vitrifiés\",\"materiaux\":\"bois, céramique, ciment, verre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2001\",\"description\":\"Joan Crous propose une œuvre qui immortalise un repas partagé dans la forêt avec quatorze convives, autour d'une table taillée dans un fut d'arbre, dans une pièce creusée et maçonnée dans le sol. Les reliefs de ce repas et la vaisselle utilisée, après avoir été vitrifiés, sont présentés dans une grande chasse en verre qui isole et préserve la scène intacte. Mis en valeur dans un espace architectural à la manière des vestiges historiques ou archéologiques, ce moment de vie et de fête est sacralisé, sanctuarisé.\",\"image_principale\":\"Joan_Crous_Supper_Memory_VdF2001_credit_inconnu_(4).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Joan_Crous_Supper_Memory_VdF2001_credit_inconnu_(4).jpg\",\"artiste\":\"Joan Crous\",\"latitude\":\"48.905\",\"longitude\":\"5.4197\",\"titre\":\"Supper Memory\",\"url\":\"http://publicartmuseum.net/wiki/Supper_Memory_(Joan_Crous)\"}");
