		obj = new JSONObject("{\"id\":\"5236\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"materiaux\":\"acier, peinture\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Faust Cardinali dresse tout près d'une loge de chasse trois tableaux métalliques découpés de silhouettes d'animaux sauvages (cerfs, sangliers, oiseaux…) à proximité d'une table présentant les contours de fusils de chasse. L'artiste traduit son fantasme et son sentiment ambivalent envers la chasse et ses traditions à travers ses tableaux à qui, tout en ayant l'air pacifiques, peuvent pendre à tout moment les vestiges d’une ripaille ou d’une battue.\",\"image_principale\":\"2005_0505relmari0144.JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2005_0505relmari0144.JPG\",\"artiste\":\"Faust Cardinali\",\"latitude\":\"48.95\",\"longitude\":\"5.4136\",\"titre\":\"Sans titre\",\"url\":\"http://publicartmuseum.net/wiki/Sans_titre_(Faust_Cardinali)\"}");
