		obj = new JSONObject("{\"id\":\"5235\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1998\",\"description\":\"Terje Ojaver met en pot une sélection de majestueux arbres de la forêt. A la fois protégés et mis en valeur par les énormes jardinières en bois, ils apparaissent encore plus imposants et sont sacralisés. Ce geste d'attention qui célèbre ces forces de la nature symbole de longévité et de fertilité met aussi en exergue la responsabilité et l'impact de l'homme sur l'écosystème d'une forêt gérée depuis des siècles.\",\"image_principale\":\"Terje_Ojaver_Responsabilite_VdF1998_credit_VdF-2005-05.JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Terje_Ojaver_Responsabilite_VdF1998_credit_VdF-2005-05.JPG\",\"artiste\":\"Terje Ojaver\",\"latitude\":\"48.9055\",\"longitude\":\"5.4148\",\"titre\":\"Responsabilité\",\"url\":\"http://publicartmuseum.net/wiki/Responsabilit%C3%A9_(Terje_Ojaver)\"}");
