		obj = new JSONObject("{\"id\":\"5234\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"végétaux\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1998\",\"description\":\"Ryszard Litwiniuk transforme un chêne abattu en réunissant par un axe pivotant le tronc couché et la souche ancrée dans le sol. Ce geste ne peut pas lui redonner vie mais amorce une métamorphose, une Renaissance symbolique : l’arbre désormais barrière, se redresse et nous laisse entrer dans l’univers de la forêt.\",\"image_principale\":\"Ryszard_Litwiniuk_Renaissance_VdF1998_credit_CDT_Meuse-2004-07(2).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Ryszard_Litwiniuk_Renaissance_VdF1998_credit_CDT_Meuse-2004-07(2).jpg\",\"artiste\":\"Ryszard Litwiniuk\",\"latitude\":\"48.9135444\",\"longitude\":\"5.3789666666667\",\"titre\":\"Renaissance\",\"url\":\"http://publicartmuseum.net/wiki/Renaissance_(Ryszard_Litwiniuk)\"}");
