		obj = new JSONObject("{\"id\":\"5233\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"longueur\":\"0,5\",\"hauteur\":\"3\",\"materiaux\":\"acier, béton, bronze, peinture\",\"couleur\":\"blanc\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Nicolas Schneider sonde la forêt à la recherche de rivières souterraines, avec les compétences d'un sourcier. L'eau, toujours au centre de ses préoccupations artistiques, est ici évoquée par la représentation de sa captation à la source et de sa rétention dans un abreuvoir stylisé. L'oeuvre nous signale ainsi la richesse silencieuse du sol et sa possible exploitation.\",\"image_principale\":\"Peut_etre_I.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Peut_etre_I.jpg\",\"artiste\":\"Nicolas Schneider\",\"latitude\":\"48.9269\",\"longitude\":\"5.3761\",\"titre\":\"Peut-être I\",\"url\":\"http://publicartmuseum.net/wiki/Peut-%C3%AAtre_I_(Nicolas_Schneider)\"}");
