		obj = new JSONObject("{\"id\":\"5232\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Maciej Albrzykowski échafaude le long de la route de Louvent un pont en bois en trois parties, qui ne traverse aucune voie et perd sa fonctionnalité. Il prend naissance au sol, s'élève progressivement, se façonne, se précise, s'affirme comme un objet-pont, une sculpture, un évènement dans le paysage.\",\"image_principale\":\"1997_001Maciej_ALBRZYKOWSKI_Par_erreur.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:1997_001Maciej_ALBRZYKOWSKI_Par_erreur.jpg\",\"artiste\":\"Maciej Albrzykowski\",\"latitude\":\"48.9197\",\"longitude\":\"5.4185\",\"titre\":\"Par erreur\",\"url\":\"http://publicartmuseum.net/wiki/Par_erreur_(Maciej_Albrzykowski)\"}");
