		obj = new JSONObject("{\"id\":\"5231\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Rupt-devant-Saint-Mihiel\",\"Sitenom\":\"Forêt communale de Rupt-devant-Saint-Mihiel\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"bois, pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Sven Domann compose au cœur de la forêt une scène archaïque avec des matériaux simples et naturels : un agencement de pierres plates blanches disposées en demi-cercle et de tronçons de bois taillés, plantés verticalement. Cette œuvre organise une sorte de petit théâtre primitif qui reçoit dans la mi-ombre du feuillage la clarté des rayons de lune et vibre au rythme de la luminosité changeante de la forêt.\",\"image_principale\":\"Sven_Domann_Ombre_de_lune_VdF1997_credit_Camille_Gresset_2013_07_24_(1).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Sven_Domann_Ombre_de_lune_VdF1997_credit_Camille_Gresset_2013_07_24_(1).JPG\",\"artiste\":\"Sven Domann\",\"latitude\":\"48.8931\",\"longitude\":\"5.4057\",\"titre\":\"Ombre de Lune\",\"url\":\"http://publicartmuseum.net/wiki/Ombre_de_Lune_(Sven_Domann)\"}");
