		obj = new JSONObject("{\"id\":\"5230\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1998\",\"description\":\"Stéphanie Buttier et Françoise Crémel construisent un tas de bois démesuré, un stère gigantesque qui s'élève entre les arbres de la forêt. Les proportions inhabituelles de cet amoncèlement de rondins parfaitement rangés obstruent la vue, le passage, et rendent leur utilisation impossible. Cette construction évoque à la fois le labeur, terrestre, parfois vain, et les aspirations de l'homme à s'élever vers les hauteurs, peut-être jusqu'au ciel.\",\"image_principale\":\"2014_01_13_oeuvre_seule_Butter&F.Cremel_Notre_stere_qui_est_aux_cieux_vdf1998@Hadrien_FRANCESCHINI(5).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2014_01_13_oeuvre_seule_Butter&F.Cremel_Notre_stere_qui_est_aux_cieux_vdf1998@Hadrien_FRANCESCHINI(5).JPG\",\"artiste\":\"Stéphanie Buttier, Françoise Crémel\",\"latitude\":\"48.9241\",\"longitude\":\"5.4549\",\"titre\":\"Notre stère qui est aux cieux\",\"url\":\"http://publicartmuseum.net/wiki/Notre_st%C3%A8re_qui_est_aux_cieux_(St%C3%A9phanie_Buttier%2C_Fran%C3%A7oise_Cr%C3%A9mel)\"}");
