		obj = new JSONObject("{\"id\":\"5229\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2001\",\"description\":\"Bong-Gi Park assemble méticuleusement les chutes de bois consécutives à l'abattage de cinq arbres pour reconstituer leurs nouveaux troncs. L'agencement des petits fragments cloués entre eux en un cylindre compact redonne à l'arbre mutilé sa verticalité, et crée une nouvelle espèce végétale voisinant avec les charmes, les chênes et les épicéas de la futaie.\",\"image_principale\":\"Bong-Gi-Park_Neighborhood_VdF2001_credit_Marie_Paule_Soncourt-2004-04.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Bong-Gi-Park_Neighborhood_VdF2001_credit_Marie_Paule_Soncourt-2004-04.jpg\",\"artiste\":\"Bong-Gi Park\",\"latitude\":\"48.9209\",\"longitude\":\"5.3519\",\"titre\":\"Neighborhood\",\"url\":\"http://publicartmuseum.net/wiki/Neighborhood_(Bong-Gi_Park)\"}");
