		obj = new JSONObject("{\"id\":\"5228\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Rupt-devant-Saint-Mihiel\",\"Sitenom\":\"Forêt communale de Rupt-devant-Saint-Mihiel\",\"hauteur\":\"3,5\",\"precision_materiaux\":\"Acier galvanisé\",\"materiaux\":\"acier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Didier Béquillard dresse au bout de tiges métalliques six emporte-pièces aux formes de parcelles cadastrales. Les pièces de ce puzzle s'agitent aux vents tels des mobiles ou des étendards. Les contours des territoires ainsi délimités dessinent des formes simples que le regard traverse, qui se détachent sur le fond paysagé et produisent une géographie miniature et poétique.\",\"image_principale\":\"Didier_Bequillard_Morceaux_choisis_VdF2004_credit_VdF_2006_06_(1).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Didier_Bequillard_Morceaux_choisis_VdF2004_credit_VdF_2006_06_(1).JPG\",\"artiste\":\"Didier Béquillard\",\"latitude\":\"48.8924\",\"longitude\":\"5.4036\",\"titre\":\"Morceaux choisis\",\"url\":\"http://publicartmuseum.net/wiki/Morceaux_choisis_(Didier_B%C3%A9quillard)\"}");
