		obj = new JSONObject("{\"id\":\"5227\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"longueur\":\"2\",\"hauteur\":\"0,7\",\"precision_materiaux\":\"Sapin\",\"materiaux\":\"acier, bois, peinture\",\"couleur\":\"jaune\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Patrick Demazeau (dit Made) crée un dialogue tangible entre un banc public et le charme qui traverse son assise. Invité à faire une halte le promeneur se trouve au plus près de ce qu'il vient observer, un arbre avec lequel il peut converser en toute intimité. L'imbrication des deux éléments, à la fois simple et absurde, évoque l'escapade d'un mobilier urbain en quête d’espace sauvage et un arbre en liberté que la ville n'arrête pas.\",\"image_principale\":\"1997_004bis_MADE_Mobilier_d+®surbanis+®.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:1997_004bis_MADE_Mobilier_d+®surbanis+®.jpg\",\"artiste\":\"Made\",\"latitude\":\"48.9179\",\"longitude\":\"5.3563\",\"titre\":\"Mobilier désurbanisé\",\"url\":\"http://publicartmuseum.net/wiki/Mobilier_d%C3%A9surbanis%C3%A9_(Made)\"}");
