		obj = new JSONObject("{\"id\":\"5226\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Rupt-devant-Saint-Mihiel\",\"precision_materiaux\":\"Calcaire d'Euville\",\"materiaux\":\"pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Tanya Preminger grave un imposant bloc de pierre brute de l'inscription “Made by God”. L'artiste se confronte et se soumet à la force créatrice de Dieu en faisant rivaliser la sentence inscrite avec la puissance du matériau choisi. La dualité entre la présence physique de l'œuvre et la spiritualité de l'intention engendre une réflexion sur la genèse de toute création.\",\"image_principale\":\"Tanya_Preminger_Made_by_God_VdF1999_credit_VdF-2007_(1).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Tanya_Preminger_Made_by_God_VdF1999_credit_VdF-2007_(1).JPG\",\"artiste\":\"Tanya Preminger\",\"latitude\":\"48.8959\",\"longitude\":\"5.3968\",\"titre\":\"Made by God\",\"url\":\"http://publicartmuseum.net/wiki/Made_by_God_(Tanya_Preminger)\"}");
