		obj = new JSONObject("{\"id\":\"5225\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"precision_materiaux\":\"Calcaire d'Euville\",\"materiaux\":\"pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2000\",\"description\":\"Jean-pierre Brazs plante à la lisière de la forêt et d'un champ deux impressionnants blocs de pierre calcaire extraits de la carrière d'Euville. Leur emplacement soigneusement choisi et leur inclinaison qui évoque les ailes d'un oiseau permettent à la roche de capter la lumière et à la pluie de ruisseler. L'étroit passage entre les formes gravées de motifs archaïques invente une transition entre les espaces, condense l'énergie tellurique du lieu et la force des éléments.\",\"image_principale\":\"Jean_Pierre_Brazs_L_oiseau_de_source_VdF2001_credit_Roland_Paulet-2007-04.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Jean_Pierre_Brazs_L_oiseau_de_source_VdF2001_credit_Roland_Paulet-2007-04.jpg\",\"artiste\":\"Jean-Pierre Brazs\",\"latitude\":\"48.9216\",\"longitude\":\"5.3868\",\"titre\":\"L'Oiseau source\",\"Siteville\":\"Ville\",\"url\":\"http://publicartmuseum.net/wiki/L%27Oiseau_source_(Jean-Pierre_Brazs)\"}");
