		obj = new JSONObject("{\"id\":\"5224\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"precision_materiaux\":\"Sapin, pigment bleu\",\"materiaux\":\"bois, pierre\",\"couleur\":\"bleu\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Nicolas Chenard édifie dans une clairière un sanctuaire archaïque reprenant les codes de la mythologie. Il fait dialoguer un âtre central formant autel, bleu comme un œil, avec douze troncs sculptés disposés autour de façon circulaire ; révélant un espace de cérémonie, de rite. Dans les profondeurs de la forêt resurgissent le souvenir de cultes primitifs venus des origines de l'humanité et la ferveur de célébrations païennes qui permettent la communion avec les éléments, le Ciel et la Terre.\",\"image_principale\":\"2014_05_13_oeuvre_seule_016_chenard_l_oeil_du_cyclope_vdf1997_©marine_calamai.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2014_05_13_oeuvre_seule_016_chenard_l_oeil_du_cyclope_vdf1997_©marine_calamai.jpg\",\"artiste\":\"Nicolas Chenard\",\"latitude\":\"48.9295\",\"longitude\":\"5.4244\",\"titre\":\"L'Œil du Cyclope\",\"url\":\"http://publicartmuseum.net/wiki/L%27%C5%92il_du_Cyclope_(Nicolas_Chenard)\"}");
