		obj = new JSONObject("{\"id\":\"5223\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"precision_materiaux\":\"pierre calcaire\",\"materiaux\":\"pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2002\",\"description\":\"Walther Piesch modélise dans un bloc de calcaire taillé un site de fouille archéologique crétois situé sur l'Ile de Santorin. L'harmonie et la pureté des formes architecturales émergeant de la masse compacte distillent une forme de sérénité et expriment le mystère, l'émotion de la rencontre de l'artiste avec ce lieu.\",\"image_principale\":\"Walther_Piesch_Lieu_de_reve_VdF2002_credit_Patricia_Lion-2006.JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Walther_Piesch_Lieu_de_reve_VdF2002_credit_Patricia_Lion-2006.JPG\",\"artiste\":\"Walther Piesch\",\"latitude\":\"48.9281\",\"longitude\":\"5.4398\",\"titre\":\"Lieu de rêve\",\"url\":\"http://publicartmuseum.net/wiki/Lieu_de_r%C3%AAve_(Walther_Piesch)\"}");
