		obj = new JSONObject("{\"id\":\"5221\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"materiaux\":\"acier, bois, pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1998\",\"description\":\"Kazys Venclovas dresse dans la forêt un tronc écorcé et garni de pierres blanches au bout de tiges de métal. Cet étonnant Sapin aux feuilles de pierre résiste au temps et semble convier les promeneurs à une ronde joyeuse dans l'ombre des sous-bois. Totem de la convivialité, il est le témoin des réjouissances des hommes et de la vitalité de la nature environnante.\",\"image_principale\":\"2003_oeuvre_seule_033_Kazys_Venclovas_Le_sapin_vdf1998_©Claude_Teter_(3).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_033_Kazys_Venclovas_Le_sapin_vdf1998_©Claude_Teter_(3).JPG\",\"artiste\":\"Kazys Venclovas\",\"latitude\":\"48.8948\",\"longitude\":\"5.4163\",\"titre\":\"Le Sapin\",\"url\":\"http://publicartmuseum.net/wiki/Le_Sapin_(Kazys_Venclovas)\"}");
