		obj = new JSONObject("{\"id\":\"5220\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Ernst Amelung dresse trois flèches de chêne, effilées comme des roseaux ou des plumes, à la croisée de champs labourés. Aériennes, bien que solidement fichées dans le sol, elles s'élèvent face au vent, dessinent un trait d'union graphique et symbolique entre l'étendue vallonnée tracée par l'agriculture et l'immensité du ciel.\",\"image_principale\":\"Ernst_Amelung_Land_Field_Forest_signs_VdF_1997_credit_Yves_Arielle_Bacourt-1999-09_(1).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Ernst_Amelung_Land_Field_Forest_signs_VdF_1997_credit_Yves_Arielle_Bacourt-1999-09_(1).jpg\",\"artiste\":\"Ernst Amelung\",\"latitude\":\"48.9357\",\"longitude\":\"5.4172\",\"titre\":\"Land Field Forest Signs\",\"url\":\"http://publicartmuseum.net/wiki/Land_Field_Forest_Signs_(Ernst_Amelung)\"}");
