		obj = new JSONObject("{\"id\":\"5218\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"precision_materiaux\":\"Grille d'acier, dalle en ciment, tube de canalisation\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2001\",\"description\":\"Aleksey Sorokin capte à l'aide d'une grille et d'une plaque de ciment une source qui prend naissance tout près. L'emprise de l'homme sur cette ressource naturelle est passagère, modeste, n'interrompt pas son parcours, et révèle tout autant qu'elle dissimule le petit ruisseau qui reprend son cours normal.\",\"image_principale\":\"2003_oeuvre_seule_072_Aleksey_Sorokin_La_source_escamotée_vdf2001_©Claude_Teter_(5).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_072_Aleksey_Sorokin_La_source_escamotée_vdf2001_©Claude_Teter_(5).JPG\",\"artiste\":\"Aleksey Sorokin\",\"latitude\":\"48.9214\",\"longitude\":\"5.4493\",\"titre\":\"La Source escamotée\",\"url\":\"http://publicartmuseum.net/wiki/La_Source_escamot%C3%A9e_(Aleksey_Sorokin)\"}");
