		obj = new JSONObject("{\"id\":\"5217\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"precision_materiaux\":\"Grillage, rondins de bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Roger Gaudreau installe dans la forêt près d'un sentier un rhinocéros à taille réelle, dont il propage d'autres spécimens à travers le monde (Québec, Allemagne, Italie, Australie, Malaisie…). La structure grillagée pérenne renferme des brindilles de noisetier collectées aux alentours amenées à disparaitre avec le temps. L'animal, mélange de puissance et de fragilité devient fantomatique, symbole d'une espèce en voie d'extinction.\",\"image_principale\":\"Roger_Gaudreau_La_migration_du_rhinoceros_VdF1999_credit_Annick_Chretien_2000(2).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Roger_Gaudreau_La_migration_du_rhinoceros_VdF1999_credit_Annick_Chretien_2000(2).jpg\",\"artiste\":\"Roger Gaudreau\",\"latitude\":\"48.9238\",\"longitude\":\"5.4599\",\"titre\":\"La Migration du rhinocéros\",\"url\":\"http://publicartmuseum.net/wiki/La_Migration_du_rhinoc%C3%A9ros_(Roger_Gaudreau)\"}");
