		obj = new JSONObject("{\"id\":\"5216\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"longueur\":\"0,5\",\"hauteur\":\"2\",\"materiaux\":\"acier, bois, peinture\",\"couleur\":\"jaune\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Catherine Beloeil plante des étiquettes de jardinage surdimensionnées au pied de neuf grands arbres d'une futaie. Habituellement utilisées pour repérer et identifier les semis, elles nous incitent à observer les spécimens choisis de façon arbitraire, sortis de l'anonymat sans pour autant avoir été nommés ou décrits. En domestiquant ainsi une partie de forêt, l'artiste classe, catégorise, agence un nouvel espace végétal, sollicite l'attention et la curiosité du promeneur.\",\"image_principale\":\"Catherine_Beloeil_La_foret_m_est_temoin_VdF1999_credit_inconnu-2007_(4).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Catherine_Beloeil_La_foret_m_est_temoin_VdF1999_credit_inconnu-2007_(4).JPG\",\"artiste\":\"Catherine Beloeil\",\"latitude\":\"48.9392\",\"longitude\":\"5.4467\",\"titre\":\"La forêt m'est témoin\",\"url\":\"http://publicartmuseum.net/wiki/La_for%C3%AAt_m%27est_t%C3%A9moin_(Catherine_Beloeil)\"}");
