		obj = new JSONObject("{\"id\":\"5215\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"precision_materiaux\":\"Corde\",\"materiaux\":\"acier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2003\",\"description\":\"Emmanuel Perrin suspend des squelettes désarticulés à de hauts branchages à la croisée de deux chemins. Animés par le vent, altérés par les intempéries, ces pendus métalliques couverts de rouille évoquent une danse macabre, une destinée tragique illustrée par le graveur nancéien du XVème siècle Jacques Callot et le poète médiéval François Villon dans sa Ballade des pendus. \",\"image_principale\":\"Emmanuel_Perrin_La_ballade_des_pendus_VdF2003_credit_Patrice_Perotin_2004-04_(1).JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Emmanuel_Perrin_La_ballade_des_pendus_VdF2003_credit_Patrice_Perotin_2004-04_(1).JPG\",\"artiste\":\"Emmanuel Perrin\",\"latitude\":\"48.9199\",\"longitude\":\"5.4448\",\"titre\":\"La Ballade des pendus\",\"url\":\"http://publicartmuseum.net/wiki/La_Ballade_des_pendus_(Emmanuel_Perrin)\"}");
