		obj = new JSONObject("{\"id\":\"5214\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"hauteur\":\"1,2\",\"precision_materiaux\":\"Pierres locales, terre\",\"materiaux\":\"pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2003\",\"description\":\"Tav Group, collectif de quatre architectes israéliens, réalise une structure composée d'une double spirale, ascendante et descendante. Ce Hole-Hill « trou-colline » est une Tour de Babel avec une issue vers le haut, le ciel, le Paradis, et une vers le bas, le centre de la terre, l'Enfer. La complémentarité des formes évoque le Yin et le Yang et vise un équilibre, une harmonie, que le promeneur peut expérimenter lorsqu'il s'assoit sur le muret de pierre\",\"image_principale\":\"2003_099_TAV_GROUP_Hole-Hill.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_099_TAV_GROUP_Hole-Hill.jpg\",\"artiste\":\"Tav Group\",\"latitude\":\"48.9235\",\"longitude\":\"5.3909\",\"titre\":\"Hole Hill\",\"url\":\"http://publicartmuseum.net/wiki/Hole_Hill_(Tav_Group)\"}");
