		obj = new JSONObject("{\"id\":\"5213\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"precision_materiaux\":\"Lettres adhésives\",\"materiaux\":\"acier\",\"couleur\":\"blanc, bleu\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Tatsuo Inagaki disperse dans la forêt douze petits panneaux sur lesquels sont écrits de courts récits. Après avoir rencontré six habitants des villages environnants et recueilli leur témoignage à propos de l'endroit qui leur est le plus cher dans la forêt, il inscrit sur le territoire la trace de leurs souvenirs personnels et célèbre la forêt comme le lieu de vie, berceau d'émotions éprouvées et partagées.\",\"image_principale\":\"Tatsuo_Inagaki_Forest_within_Forest_VdF1999_credit_Maryse_Gentilhomme-1999_(2).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Tatsuo_Inagaki_Forest_within_Forest_VdF1999_credit_Maryse_Gentilhomme-1999_(2).jpg\",\"artiste\":\"Tatsuo Inagaki\",\"latitude\":\"48.9145\",\"longitude\":\"5.4008\",\"titre\":\"Forest with Forest\",\"url\":\"http://publicartmuseum.net/wiki/Forest_with_Forest_(Tatsuo_Inagaki)\"}");
