		obj = new JSONObject("{\"id\":\"5212\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"hauteur\":\"2\",\"materiaux\":\"acier, fibre de verre, peinture, résine\",\"couleur\":\"rouge\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2005\",\"description\":\"Luc Doerflinger suspend dans la forêt neuf formes oblongues et énigmatiques de couleur rouge. Ces figures organiques au dard pointé vers le sol, balisent le terrain, ponctuent une scène désenchantée. L'artiste peintre revisite ainsi certains de ses motifs mélancoliques récurrents -cygnes, manchots, cervidés- qui incarnent une métamorphose, une mue, un abandon, un rêve brisé.\",\"image_principale\":\"Luc_Doerflinger_Figura_Translata_VdF2005_credit_Bruno_Lion_2005.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Luc_Doerflinger_Figura_Translata_VdF2005_credit_Bruno_Lion_2005.jpg\",\"artiste\":\"Luc Doerflinger\",\"latitude\":\"48.9209\",\"longitude\":\"5.4189\",\"titre\":\"Figura Translata\",\"url\":\"http://publicartmuseum.net/wiki/Figura_Translata_(Luc_Doerflinger)\"}");
