		obj = new JSONObject("{\"id\":\"5211\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"longueur\":\"1,5\",\"hauteur\":\"1,5\",\"materiaux\":\"acier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Charlie Skubich dépose une cage en métal en bordure de forêt, les barreaux tordus vers l'extérieur suggérant une évasion brutale. L'artiste invite le promeneur à se souvenir des animaux qui peuplaient jadis cette forêt ou qui rodent encore, à s'évader lui-même, à construire son propre récit, se raconter une histoire.\",\"image_principale\":\"2004_112_Charlie_SKUBICH_Evasion.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2004_112_Charlie_SKUBICH_Evasion.jpg\",\"artiste\":\"Charlie Skubich\",\"latitude\":\"48.9079\",\"longitude\":\"5.4095\",\"titre\":\"Évasion\",\"url\":\"http://publicartmuseum.net/wiki/%C3%89vasion_(Charlie_Skubich)\"}");
