		obj = new JSONObject("{\"id\":\"5210\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"materiaux\":\"acier, pierre, végétaux\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2000\",\"description\":\"Eunhee Choo emprisonne un arbre déraciné par la tempête de 1999 en partie enseveli sous un amoncèlement de pierres calcaires blanches. Seules les branches et les racines dépassent du cube, leur forme tortueuse et leur couleur sombre contrastent avec celle de la masse minérale compacte et éclatante pour immortaliser un évènement qui a profondément affecté le paysage local.\",\"image_principale\":\"2000_053_Eunhee_Cho_Essence-Existance.JPG\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2000_053_Eunhee_Cho_Essence-Existance.JPG\",\"artiste\":\"Eunhee Choo\",\"latitude\":\"48.9301\",\"longitude\":\"5.4932\",\"titre\":\"Essence-Existence\",\"url\":\"http://publicartmuseum.net/wiki/Essence-Existence_(Eunhee_Choo)\"}");
