		obj = new JSONObject("{\"id\":\"5208\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"precision_materiaux\":\"Calcaire d'Euville\",\"materiaux\":\"pierre\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1999\",\"description\":\"Françoise Maire et Michèle Schneider créent en forêt le long d'un sentier un parcours fictif, labyrinthique, qui sollicite la curiosité du marcheur. Invité à se saisir d'un galet posé dans un bénitier puis à s'orienter grâce aux bornes qui jalonnent le chemin, il déposera après son errance son petit caillou sur une dalle de calcaire blanche gravée d'une sentence, payant ainsi son tribut au Minotaure du Dédale.\",\"image_principale\":\"2003_oeuvre_seule_043_Maire_Schneider_dédale_vdf1999_©Claude_Teter_(4).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_043_Maire_Schneider_dédale_vdf1999_©Claude_Teter_(4).jpg\",\"artiste\":\"Françoise Maire, Michèle Schneider\",\"latitude\":\"48.9338\",\"longitude\":\"5.441\",\"titre\":\"Dédale\",\"url\":\"http://publicartmuseum.net/wiki/D%C3%A9dale_(Fran%C3%A7oise_Maire%2C_Mich%C3%A8le_Schneider)\"}");
