		obj = new JSONObject("{\"id\":\"5207\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"longueur\":\"10\",\"precision_materiaux\":\"Pierres calcaires\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2002\",\"description\":\"Au bout d'une allée en forêt, Liliana de Vito crée un pavage de pierres calcaires blanches taillées. Alignées en ordre croissant, elles forment un chemin qui s'allonge et s'évase, créant un effet de perspective. Accompagnez ce chemin de vie et trouvez la pierre qui correspond à votre âge entre les deux extrêmes de la vie...\",\"image_principale\":\"2003_oeuvre_seule_083_Liliana_Devito_Chemin_de_vie_vdf2002_©Claude_Teter_(31)..jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_083_Liliana_Devito_Chemin_de_vie_vdf2002_©Claude_Teter_(31)..jpg\",\"artiste\":\"Liliana de Vito\",\"latitude\":\"48.9265\",\"longitude\":\"5.3702\",\"titre\":\"Chemin de vie\",\"url\":\"http://publicartmuseum.net/wiki/Chemin_de_vie_(Liliana_de_Vito)\"}");
