		obj = new JSONObject("{\"id\":\"5205\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Nicey-sur-Aire\",\"materiaux\":\"acier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2002\",\"description\":\"Thierry Devaux scénographie le naufrage de sept barques à l'ossature métallique sur les bords de la rivière Aire. Les proues et les poupes, séparées, sont dispersées dans le lit du cours d'eau et sur ses berges de façon chaotique, dramatique. Ces barques-squelette sont le symbole échoué du voyage périlleux des âmes vers l'au-delà, de leur quête d'immortalité, de spiritualité et de salut.\",\"image_principale\":\"Thierry_Devaux_Barques_VdF2002-credit_CDT_meuse-2004-07_(3).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:Thierry_Devaux_Barques_VdF2002-credit_CDT_meuse-2004-07_(3).jpg\",\"artiste\":\"Thierry Devaux\",\"latitude\":\"48.8869\",\"longitude\":\"5.3353\",\"titre\":\"Barques\",\"url\":\"http://publicartmuseum.net/wiki/Barques_(Thierry_Devaux)\"}");
