		obj = new JSONObject("{\"id\":\"5204\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"precision_materiaux\":\"Chêne\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2003\",\"description\":\"Le collectif Humus dépose sur le sol de la forêt une longue colonne vertébrale, Backbone. Composée de segments de fût de divers diamètres posés sur tranche et assemblés, l'œuvre qui ondule sur le relief du sol semble par moment disparaitre sous terre comme un ver ou un serpent, et inspire une un léger malaise instinctif face à ce qui fourmille sous le sol de la forêt.\",\"image_principale\":\"2003_oeuvre_seule_095_Mair_Schonegger_Backbone_vdf2003_©Claude_Teter_(6).jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:2003_oeuvre_seule_095_Mair_Schonegger_Backbone_vdf2003_©Claude_Teter_(6).jpg\",\"artiste\":\"Humus\",\"latitude\":\"48.9432\",\"longitude\":\"5.4453\",\"titre\":\"Backbone\",\"url\":\"http://publicartmuseum.net/wiki/Backbone_(Humus)\"}");
