		obj = new JSONObject("{\"id\":\"5069\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Salles\",\"Sitedetails\":\"Forêt proche piste cyclable\",\"materiaux\":\"acier\",\"couleur\":\"blanc\",\"nature\":\"pérenne\",\"inauguration\":\"2014\",\"description\":\"Sébastien Vonier érige, au milieu des arbres et de la végétation foisonnante, trois figures fantomatiques, détachées de la logique de la représentation, et constituées par un équilibre de poutres autoportantes. Ces formes presque abstraites, dessinées avec une netteté particulière, se justifient par un renoncement au superflu et s’organisent en remettant en cause les oppositions dualistes entre l’ordre et le désordre, la fécondité et la sécheresse, la suspension et la relance. Il s’agit de maintenir une tension où l’incertitude et sa part de mystère acquièrent un rôle actif et délestent la matière de son inertie. C’est une étrange scène où des sentinelles indéfinissables se rassemblent autour d’un foyer imaginaire et l’attisent comme une réserve inépuisable de forces et de possibilités.\",\"image_principale\":\"14_Sébastien_Vonier.jpg\",\"creditphoto\":\"credits: © Sébastien Vonier / photo: Lydie Palaric\",\"artiste\":\"Sébastien Vonier\",\"latitude\":\"44.536151999702\",\"longitude\":\"-0.85266110302655\",\"titre\":\"Trois sans nom\",\"url\":\"http://publicartmuseum.net/wiki/Trois_sans_nom_(S%C3%A9bastien_Vonier)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5067\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Bourideys\",\"Sitedetails\":\"Sur le lac de Bourideys\",\"materiaux\":\"résine\",\"couleur\":\"jaune\",\"nature\":\"pérenne\",\"inauguration\":\"2014\",\"description\":\"Cette figure du Cheval de Troie se propose ici comme une infiltration ludique, stimulante dans le paysage, et ouvre à la manière d’une porte dérobée sur un imaginaire aux propositions multiples et imprévisibles. Prétexte à des significations très diverses, le cheval a notamment la particularité d’être associé à l’eau et assimilé à un vaisseau. Sur ce lac, Bruno Peinado le charge de ses nombreux rôles et dons magiques, et lui donne une forme pixellisée qui évoque cette méthode de camouflage basé sur l’illusion optique créée par une multiplication de facettes. La couleur jaune vif renforce cette capacité à désigner une présence offerte, sans jamais se refermer, à une large variété d’interprétations et de ressources. A chacun de faire l’expérience de la métis des Grecs qui combine l’intelligence de la ruse et la juste mesure. A chacun d’explorer à sa guise cette aventure qui se prête à toutes les libres incursions, et de la prolonger en lien avec son désir, sa fantaisie et son parcours.\",\"image_principale\":\"image-manquante.jpg\",\"creditphoto\":\"Voir atlasmuseum.net\",\"artiste\":\"Bruno Peinado,\",\"latitude\":\"44.368401342595\",\"longitude\":\"-0.45284861313121\",\"titre\":\"Une rencontre, la métis, le même et l'autre\",\"url\":\"http://publicartmuseum.net/wiki/Une_rencontre%2C_la_m%C3%A9tis%2C_le_m%C3%AAme_et_l%27autre_(Bruno_Peinado%2C)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5065\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Garein\",\"Sitedetails\":\"à côté de l'église\",\"Sitenom\":\"place des Floralies\",\"materiaux\":\"acier\",\"couleur\":\"argent\",\"nature\":\"pérenne\",\"inauguration\":\"2014\",\"description\":\"La proposition consiste à concevoir un lieu indéfinissable qui emprunte à d’autres espaces liés à la création : l’atelier, la réserve, la collection, l’exposition. Laurent Le Deunff dispose de ce lieu pour stocker, rassembler, mettre en situation certaines de ses œuvres. Il en gère l’activité pour à la fois donner à voir un choix de pièces, dans des conditions particulières et selon diverses combinaisons, et inscrire sa démarche dans une offre en évolution constante. Les œuvres ne sont pas là pour rester. Elles sont de passage, en attente d’autres destinations. Ce renouvellement permet d’entretenir l’indétermination, la surprise et donc la curiosité.C’est un lieu qui accueille et protège, enferme et désigne. C’est une cage. Le spectateur est à l’extérieur et regarde à travers les barreaux. Comme au zoo.\",\"image_principale\":\"12_Laurent_Le_Deunff.jpg\",\"creditphoto\":\"credits: Laurent Le Deunff / photo: Lydie Palaric\",\"artiste\":\"Laurent Le Deunff,\",\"latitude\":\"44.046225375246\",\"longitude\":\"-0.65026992546336\",\"titre\":\"Zoo de sculptures\",\"url\":\"http://publicartmuseum.net/wiki/Zoo_de_sculptures_(Laurent_Le_Deunff%2C)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5063\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Saint-Symphorien\",\"Sitedetails\":\"Parc du chalet Mauriac\",\"Sitenom\":\"Parc Mauriac\",\"materiaux\":\"bois, lumière, miroir\",\"nature\":\"pérenne\",\"inauguration\":\"2014\",\"description\":\"David Boeno convie à une déambulation dans le parc, ponctuée par 7 troncs d’arbre sectionnés selon des angles de coupe obtenus d’après le calcul de la trajectoire elliptique de 7 comètes. Un miroir biseauté, comme un objet précieux et étincelant, est enchâssé au cœur de chacune des sections. Sur chaque miroir est gravé le nom de la comète et la date de son futur passage au périhélie, le point de l’orbite le plus proche du Soleil qui provoque la nébulosité de la comète et rend sa chevelure fortement incandescente. Cette confrontation de l’instant présent et de l’écho d’un avenir venu d’un éloignement sidéral, de la contrainte d’une vie terrestre et des profondeurs inaccessibles du temps et de l’espace, compose une conscience du monde où s’entrecroisent les fils infinis des géométries prospectives, rêveuses, et des choses en mouvement pour former une seule trame continue.\",\"image_principale\":\"11_David_Boeno_3.jpg\",\"creditphoto\":\"credits: © David Boeno / photo: Lydie Palaric\",\"artiste\":\"David Boeno\",\"latitude\":\"44.42458383981\",\"longitude\":\"-0.49154269669089\",\"titre\":\"7 comètes à venir\",\"url\":\"http://publicartmuseum.net/wiki/7_com%C3%A8tes_%C3%A0_venir_(David_Boeno)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5061\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Sabres\",\"Sitenom\":\"pavillon de l'Ecomusée de Marquèze\",\"nature\":\"pérenne\",\"inauguration\":\"2013\",\"description\":\"Cette installation est composée de cinq écrans et propose un voyage imaginaire, réalisé en images de synthèse, dans la forêt de pins maritimes à l'ère du numérique. Chaque écran présente l'exercice ou le rituel auquel s'adonnent d’étranges créatures hybrides, issues des méandres de l’évolution, dans un temps incertain, pour traverser la forêt, puis au terme de ce périple, tenter de grimper à un arbre. Chaque personnage possède une morphologie différente, et se dote ainsi de caractéristiques motrices singulières, et donc d’une manière unique de se déplacer et de s’adapter. Chaque créature invente une pratique de la forêt, produit une expérience de son paysage rectiligne et tramé, en fonction de sa mobilité fluide ou laborieuse.\",\"image_principale\":\"10_Bertrand_Dezoteux.jpg\",\"creditphoto\":\"credits: © Bertrand Dezoteux / photo: Lydie Palaric\",\"artiste\":\"Bertrand Dezoteux\",\"latitude\":\"44.149371963353\",\"longitude\":\"-0.74711617853609\",\"titre\":\"Les Arboricoles\",\"url\":\"http://publicartmuseum.net/wiki/Les_Arboricoles_(Bertrand_Dezoteux)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5059\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Vert\",\"Sitedetails\":\"7 interventions à 7 lieux différents du village :\",\"nature\":\"pérenne\",\"inauguration\":\"2014\",\"description\":\"Younès Rahmoun ne perd jamais le contact avec le monde qui l’entoure. Il est sans cesse à l’affût de rencontres ouvertes à des traditions et des cultures différentes, et en quête d’équilibres nécessaires, à la fois matériels et spirituels. Sa démarche artistique ne vise ni à la puissance ni à l’autorité. Elle se contente de préserver des gestes simples, des traces vives de notre condition humaine et des liens intenses avec l’eau, la pierre, la terre, l’air, la lumière et toute matière qui donne à la vie son audace et sa sagesse. Elle se veut une conduite naturelle qui mène au dialogue et au partage. Younès Rahmoun s’appuie sur un vocabulaire simple, offrant une diversité de propriétés, en étroite relation avec son quotidien, ses croyances et ses expériences. Il utilise les chiffres impairs comme symbole de la variété et du pluriel, et le numéro un comme métaphore de l’unique. Il développe les constructions singulières et démultipliées d’une Ghorfa – petite chambre en arabe et réplique de l’atelier dans sa maison familiale – qui invite à la méditation, à pénétrer dans l’histoire de l’autre et à inventer d’autres possibilités de refuge. Younès Rahmoun propose 7 étapes d’une découverte du village, chacune marquée par une action susceptible de corriger tout défaut de clairvoyance et de maintenir l’exigence d’une harmonie. Sur la façade de l’église, se dessine la maison de l’âme et du cœur.La construction d’une Ghorfa, en écho à la forêt disparue, accompagne la transformation d’un champ de fougères en champ de fleurs. Le parcours continue par l’attention accordée à la source guérisseuse, la réactivation du lavoir et de sa promesse de transparence, la plantation de l’arbre de l’enfance sur l’île, le geste éphémère qui consiste à réaliser, dans le cimetière, un bateau à l’aide de 7 cailloux du Rif et la mémoire soulevée par la voix de Mr Joseph, habitant du village, et les images de Félix Arnaudin dans le four à pain.\",\"image_principale\":\"09_Younès_Rahmoun,_La_Ghorfa.jpg\",\"creditphoto\":\"credits: © Younès Rahmoun /photo: Lydie Palaric\",\"artiste\":\"Younès Rahmoun\",\"latitude\":\"44.091194795221\",\"longitude\":\"-0.57694074513165\",\"titre\":\"Ghorfa-Markib-Ma'e-Zahra, Chajara-Khobze-Sakane\",\"url\":\"http://publicartmuseum.net/wiki/Ghorfa-Markib-Ma%27e-Zahra%2C_Chajara-Khobze-Sakane_(Youn%C3%A8s_Rahmoun)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5057\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Sabres\",\"Sitenom\":\"Le Saucissé\",\"materiaux\":\"acier, fer\",\"nature\":\"pérenne\",\"inauguration\":\"2013\",\"description\":\"Dans ce lieu chargé d’un passé oublié, d’un mystère, Marie Denis invite à retrouver, à imaginer les indices et les signes que le temps et l’histoire ont mêlés ou effacés. Son portail Art déco, en fer forgé, se dresse sans ostentation, entouré de chênes, dans l’élégante nudité de son vécu, comme la vigie familière d’une mémoire à partager, et s’entrouvre pour laisser libre cours aux échanges entre le réel et l’imaginaire, le visible et l’invisible, l’ici et l’ailleurs. Il est paré de tubes de carillon en inox, agencés dans un équilibre sonore et intriguant. Le moindre souffle de vent l’anime et l’emporte dans une phrase musicale, imprévisible, enchantée et donc légendaire, qui a la fragilité d’un rêve et la simplicité primitive d’une émotion.\",\"image_principale\":\"08_Marie_Denis2.jpg\",\"creditphoto\":\"credits: © Marie Denis /photo: Lydie Palaric\",\"artiste\":\"Marie Denis\",\"latitude\":\"44.150876946702\",\"longitude\":\"-0.83201882138383\",\"titre\":\"La Portée\",\"url\":\"http://publicartmuseum.net/wiki/La_Port%C3%A9e_(Marie_Denis)\"}");
