		obj = new JSONObject("{\"id\":\"5055\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Brocas\",\"Sitenom\":\"Garbachet\",\"materiaux\":\"fonte, pierre\",\"nature\":\"pérenne\",\"inauguration\":\"2013\",\"description\":\"Au Moyen Âge, une sauveté était une zone de refuge dessinée autour d'une église par plusieurs bornes. À l'intérieur de ce périmètre, il était interdit de poursuivre les fugitifs. Sans l’encombrer ni la confisquer, Christophe Doucet prend possession d’une parcelle d’un hectare, située autour d’une cabane et d’un puits, délimitée par quatre colonnes positionnées à chaque point cardinal, bâties en pierre locale et surmontées d’une oreille de lapin en fonte d’aluminium, à l’écoute des respirations les plus secrètes. Enregistré au cadastre, ce lieu donne ainsi la mesure de cette singulière protection, venue d’un temps lointain, et invite à l’expérience de son étendue, en perpétuel mouvement, et de sa capacité à affirmer la variété réelle et fictionnelle de ses ressources.\",\"image_principale\":\"07_Christophe_Doucet.jpg\",\"creditphoto\":\"credits: © Christophe Doucet / photo: Lydie Palaric\",\"artiste\":\"Christophe Doucet,\",\"latitude\":\"44.020466\",\"longitude\":\"-0.58840099999998\",\"titre\":\"La Sauveté de Garbachet\",\"url\":\"http://publicartmuseum.net/wiki/La_Sauvet%C3%A9_de_Garbachet_(Christophe_Doucet%2C)\"}");
