		obj = new JSONObject("{\"id\":\"5053\",\"proprietaire\":\"Musée Despiau Wlérick, collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Mont-de-Marsan\",\"Sitenom\":\"Parc Jean-Rameau\",\"materiaux\":\"bois, bronze, métal\",\"nature\":\"pérenne\",\"inauguration\":\"2012\",\"description\":\"L'ONU a décrété que 2011 était l'Année Internationale des Forêts. A l'initiative de l'association des amis de Graine de Forêt différents partenaires professionnels ont mutualisé leurs connaissances et leurs moyens afin de s'inscrire dans la démarche initié par l'ONU et relayée par l’État Français. L’œuvre de Roland Cognet met en valeur cette démarche et fait échos à cette célébration de l'année de la forêt.\",\"image_principale\":\"image-manquante.jpg\",\"creditphoto\":\"Voir atlasmuseum.net\",\"artiste\":\"Roland Cognet\",\"latitude\":\"43.894992184203\",\"longitude\":\"-0.50061339126842\",\"titre\":\"Paysage et Loup\",\"url\":\"http://publicartmuseum.net/wiki/Paysage_et_Loup_(Roland_Cognet)\"}");
