		obj = new JSONObject("{\"id\":\"5051\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Commensacq\",\"Sitedetails\":\"Devant la salle des fêtes, sur l'ancienne voie ferrée\",\"materiaux\":\"béton\",\"couleur\":\"gris\",\"nature\":\"pérenne\",\"inauguration\":\"2011\",\"description\":\"'Pour La Forêt d’Art Contemporain, je me suis concentrée sur le site de Marquèze, témoin privilégié des liens étroits qui unissent dans cette région la population à son environnement. Ma pratique est très attachée au travail in situ et une sculpture doit toujours porter les traces du contexte particulier (lieu, espace, temps) dans lequel elle prend naissance. La matière première de mes pièces est donc souvent directement prélevée sur place, il s’agit essentiellement d’objets ou de matériaux « communs », appartenant à une sorte de mémoire collective.\",\"image_principale\":\"05_Stéphanie_Cherpin.jpg\",\"creditphoto\":\"credits: © Stéphanie Cherpin /photo: Lydie Palaric\",\"artiste\":\"Stéphanie Cherpin\",\"latitude\":\"44.210348847021\",\"longitude\":\"-0.82723376148351\",\"titre\":\"Vis Mineralis\",\"url\":\"http://publicartmuseum.net/wiki/Vis_Mineralis_(St%C3%A9phanie_Cherpin)\"}");
