		obj = new JSONObject("{\"id\":\"5047\",\"precision_etat_conservation\":\"tags\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"La Teste-de-Buch\",\"Sitedetails\":\"En face du zoo de La Teste\",\"Sitenom\":\"Le Natus\",\"materiaux\":\"béton, brique, céramique, ciment\",\"nature\":\"pérenne\",\"inauguration\":\"2011\",\"description\":\"La sculpture pérenne de Sarah Tritz (née en 1980) a été réalisée avec l'équipe des maçons municipaux de La Teste de Buch. Partant de plans et de collages, de dessins à l'encre réalisés en amont, l'artiste a néanmoins improvisé certaines modifications et trouvailles (percées plus nombreuses et couleurs différentes), inspirées par sa présence sur place, dans le paysage.\",\"image_principale\":\"03_Sarah_Tritz.JPG\",\"creditphoto\":\"credits: © Sarat Tritz /photo: Lydie Palaric\",\"artiste\":\"Sarah Tritz\",\"latitude\":\"44.586629504267\",\"longitude\":\"-1.1387704608205\",\"titre\":\"La Moderne\",\"url\":\"http://publicartmuseum.net/wiki/La_Moderne_(Sarah_Tritz)\"}");
