		obj = new JSONObject("{\"id\":\"5044\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Garein\",\"Sitedetails\":\"espace dévasté par la tempête Klaus\",\"longueur\":\"4\",\"hauteur\":\"4\",\"materiaux\":\"bois\",\"nature\":\"pérenne\",\"inauguration\":\"2011\",\"description\":\"'Ma volonté a été de formuler une proposition pour un monument, le contexte s’y prête. Au-delà d’une commémoration de l’Événement climatique qu’a été la tempête de 2009 sur ce territoire, il me semble important de requalifier les impacts et de faire glisser la catastrophe du Naturel au Domestique.\",\"image_principale\":\"02_Alain_Domagala.jpg\",\"creditphoto\":\"credits: © Alain Domagala/ photo: Lydie Palaric\",\"artiste\":\"Alain Domagala,\",\"latitude\":\"44.053804427249\",\"longitude\":\"-0.60608375046286\",\"titre\":\"Aux impétueuses manœuvres de l'imprévu\",\"url\":\"http://publicartmuseum.net/wiki/Aux_imp%C3%A9tueuses_man%C5%93uvres_de_l%27impr%C3%A9vu_(Alain_Domagala%2C)\"}");
