		obj = new JSONObject("{\"id\":\"5038\",\"proprietaire\":\"Fond National d'Art Contemporain - Itinéraire La Forêt d'Art Contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Garein\",\"Sitenom\":\"Landes du Pouchiou\",\"mot_cle\":\"lit, charpenterie, désir\",\"materiaux\":\"bois, métal\",\"programme\":\"Dépôt du Fond National d'Art Contemporain FNAC 01-181\",\"nature\":\"pérenne\",\"inauguration\":\"1995\",\"description\":\"Par une sorte de « logique miraculeuse », cette œuvre a choisi, grâce à ses divers acteurs et témoins d’emprunter sa force d'origine, lui apportant, par sa forme d’œuvre d'art, un retour d'âme. Conçu pour inviter le visiteur à « venir coucher un désir de nature inconnue » en son centre, le Lit transcendantal utilise les matériaux et techniques de charpente de la maison traditionnelle de la Grande Lande et se veut, par ses assemblages et traits de coupe complexes, un hommage à la charpenterie du XVII siècle. La matière et la technique ont été, pour Claire Roudenko-Bertin réinformées par la pensée artistique.\",\"image_principale\":\"00_Claire_Roudenko-Bertin,_Lit_transcendantal,_1995_FNAC_01_181_crédit_Lydie_Palaric.jpg\",\"creditphoto\":\"credits: © Claire Roudenko-Bertin / photo: © Lydie Palaric\",\"artiste\":\"Claire Roudenko-Bertin\",\"latitude\":\"44.051207414503\",\"longitude\":\"-0.64988610141882\",\"titre\":\"Lit transcendantal\",\"url\":\"http://publicartmuseum.net/wiki/Lit_transcendantal_(Claire_Roudenko-Bertin)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"5035\",\"precision_etat_conservation\":\"fentes/fissures\",\"proprietaire\":\"Collection La Forêt d'art contemporain\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Aquitaine\",\"Siteville\":\"Arue\",\"Sitedetails\":\"En pleine forêt à proximité d'une piste de randonnée du Conseil Général des Landes. Accessible en voiture.\",\"Sitenom\":\"route du Ginx\",\"hauteur\":\"11\",\"materiaux\":\"aluminium, bois\",\"contexte_production\":\"'Dans le contexte de la Forêt d'Art Contemporain, j'ai imaginé cette sculpture réactualisée comme une sorte de fétiche, de porte bonheur à la forêt dévastée, comme un symbole de la fragilité de la verticalité de la forêt, aussi bien face aux coupes rases, qu'à la tempête. Partir d'une sculpture d'étudiante à échelle humaine qui joue sur l'équilibre, et la transformer après quelques années en une sculpture monumentale et résistante réalisée dans des matériaux d'extérieur prenant en considération le contexte de cette forêt et la position premièrement éloignée du regardeur est une étape importante au sein de ma pratique. Je désire conserver un peu de mystère autour de cette oeuvre et ne dévoilerai donc pas un certain nombre d'éléments essentiels, pour que les regardeurs aient la primeur de l'expérience de la sculpture.' \",\"nature\":\"pérenne\",\"inauguration\":\"2011\",\"description\":\"'Le projet Coeur Chaud Bois d'Aquitaine a comme point de départ une pièce ancienne, réalisée pour mon diplôme, en 2004. Cette sculpture, en forme de tipi, était le résultat d'expériences d'érection d'une forme avec un minimum de matière. Pour porter chance à ce travail, j'étais partie d'une esquisse épurée de fer à cheval qui devait couronner cette construction, puis, en testant dans l'atelier, c'est finalement ce fer à cheval qui assemblait les tasseaux, et donnait cette forme 'vrillée', en mouvement, au tipi.' Émilie Perotto, février 2011\",\"image_principale\":\"01_Emilie_Perotto,_Coeur_Chaud_Bois_d'Aquitaine,_Arue_2011_programmation_Laurent_Le_Deunff_crédit_Lydie_Palaric.jpg\",\"creditphoto\":\"credits: © Emilie Perotto / photo: Lydie Palaric\",\"artiste\":\"Émilie Perotto\",\"latitude\":\"44.046372410771\",\"longitude\":\"-0.37533518665441\",\"titre\":\"Cœur chaud bois d'Aquitaine\",\"url\":\"http://publicartmuseum.net/wiki/C%C5%93ur_chaud_bois_d%27Aquitaine_(%C3%89milie_Perotto)\"}");
