		obj = new JSONObject("{\"id\":\"5031\",\"autre_precision_etat_conservation\":\"Œuvres détruites en 2001.\",\"Sitepmr\":\"je ne sais pas\",\"Sitepays\":\"Afghanistan\",\"Sitedetails\":\"Les Bouddhas de Bâmiyân sont situés dans le centre-est de l'Afghanistan, dans le district de Bâmiyân de la province du même nom, au nord-nord-ouest de la capitale Kaboul.\",\"Sitenom\":\"Bâmiyân\",\"nature\":\"pérenne\",\"description\":\"Les Bouddhas de Bâmiyân sont trois statues monumentales en haut-relief de bouddhas debout, excavées dans la paroi d'une falaise située dans la vallée de Bâmiyân du centre de l'Afghanistan, à 230 kilomètres au nord-ouest de Kaboul et à une altitude de 2 500 mètres. Le site tout entier est classé au patrimoine mondial de l'UNESCO.Les statues ont aujourd'hui disparu après avoir été détruites en mars 2001 par les talibans. Les statues sont au nombre de trois : le grand Bouddha avec 53 mètres de hauteur et le petit Bouddha avec 38 mètres de hauteur situées juste à côté de la ville de Bâmiyân ainsi que le Bouddha de Kakrak mesurant 10 mètres de hauteur et situé à quatre kilomètres au sud-est. Les détails fin modelé sur la roche par un mélange de paille et de plâtre en font des représentants du style Gandhara. Les statues étaient à l'origine colorées, la plus grande en carmin et les autres de multiples couleurs.Un quatrième Bouddha est mentionné dans d'anciens textes ; il serait couché, mesurerait environ 300 mètres de longueur et serait enseveli sous les alluvions de la vallée.\",\"image_principale\":\"Taller_Buddha_of_Bamiyan_before_and_after_destruction.jpg\",\"creditphoto\":\"credits: CC BY-SA 3.0/ source: [http://fr.wikipedia.org/wiki/Bouddhas_de_B%C3%A2miy%C3%A2n#mediaviewer/File:Taller_Buddha_of_Bamiyan_before_and_after_destruction.jpg Wikipédia]\",\"artiste\":\"artistes inconnus\",\"latitude\":\"34.831697896184\",\"longitude\":\"67.826480984731\",\"titre\":\"Bouddhas de Bâmiyân\",\"Siteville\":\"Ville\",\"url\":\"http://publicartmuseum.net/wiki/Bouddhas_de_B%C3%A2miy%C3%A2n_(artistes_inconnus)\"}");
