		obj = new JSONObject("{\"id\":\"5025\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteville\":\"Paris\",\"Sitedetails\":\"Plafond de l'Opéra National de Paris (Palais Garnier). André Malraux, ministre des Affaires culturelles, décida en 1960 ce geste spectaculaire, hardi à l’époque : confier le décor du plafond de l’Opéra à Marc Chagall.\",\"Sitenom\":\"Palais Garnier\",\"contexte_production\":\"Pour le plafond de l’Opéra, Marc Chagall refusa d’être rémunéré et l’État n’assuma que les frais de réalisation matérielle. L’œuvre fut exécutée entre janvier et août 1963, le peintre travaillant d’abord au musée des Gobelins, puis à Meudon, dans l’atelier qu’avait construit Gustave Eiffel (et qui devait devenir un musée de l’Aviation), à Vence enfin. Elle fut inaugurée le 23 septembre 1964.\",\"nature\":\"pérenne\",\"inauguration\":\"1964\",\"description\":\"Le plafond de Chagall est constitué de douze panneaux et un panneau circulaire central de toile montés sur une armature de plastique (deux cent quarante mètres carrés environ), et signé par l’artiste sur le panneau central et sur le panneau principal : « Chagall Marc 1964 ». Chagall est un lyrique, et il y a, dans son plafond, une correspondance, une sympathie plus profonde qu’il n’y paraît avec l’œuvre de Garnier. La peinture de Chagall est, pour reprendre le mot d’Apollinaire visitant son atelier de la Ruche pour la première fois en 1912, « sur-naturelle » (ce terme laissera place plus tard à celui de « surréaliste »), comme le palais enchanté de Garnier. Pour l’esprit religieux voire mystique de Marc Chagall, tout dans l’univers se tient et est mû par l’amour ; êtres et choses sont entraînés dans une circulation totale où il n’y a ni haut ni bas, ni pesanteur ni résistance – l’idéal pour peindre un plafond d’opéra !\",\"image_principale\":\"image-manquante.jpg\",\"creditphoto\":\"Voir atlasmuseum.net\",\"artiste\":\"Marc Chagall\",\"latitude\":\"48.871903\",\"longitude\":\"2.3319011\",\"titre\":\"sans titre\",\"url\":\"http://publicartmuseum.net/wiki/sans_titre_(Marc_Chagall)\"}");
