		obj = new JSONObject("{\"id\":\"4989\",\"proprietaire\":\"inconnu\",\"Sitepmr\":\"pas d'information pmr\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Vincent Lamouroux réalise une architecture éphémère et inédite dans le ciel à bord d'un petit avion. A partir d’une cartographie du paysage et du relief, des tracés repérés au sol, il dessine et décrit une forme qui s'expose et se dérobe à la vue dans le temps. Le vol produit une navigation qui crée une relation entre de multiples points dont l'enregistrement par le transpondeur génère une forme en 3D qui restitue les paramètres et le motif de la trajectoire.\",\"image_principale\":\"Images10.jpg\",\"creditphoto\":\"credits: Vincent Lamouroux / photo : Vincent Lamouroux\",\"artiste\":\"Vincent  Lamouroux\",\"latitude\":\"0.0\",\"longitude\":\"0.0\",\"titre\":\"ATLS\",\"Sitepays\":\"Pays\",\"Siteville\":\"Ville\",\"url\":\"http://publicartmuseum.net/wiki/ATLS_(Vincent__Lamouroux)\"}");
