		obj = new JSONObject("{\"id\":\"4988\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"pas d'information pmr\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"precision_materiaux\":\"Chaux inerte, Farine de seigle\",\"couleur\":\"blanc\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2010\",\"description\":\"Vincent Lamouroux peint un immense bosquet en pleine forêt d’un blanc éclatant. La végétation qui a d’abord été sculptée en forme de dôme évoque un spectacle surnaturel, un émerveillement provoqué par le contraste des couleurs, l'étrangeté de la matière qui recouvre le feuillage et l'exaltation de ses proportions. Cette œuvre dont les nuances changent sous la pluie est soumise aux caprices des éléments et du temps. Tel un mirage, elle est amenée à disparaître après avoir été contemplée.\",\"image_principale\":\"Vincent_Lamouroux_Aire23_VdF2012_credit_Guillaume_Onimus_(1).jpg\",\"creditphoto\":\"credits: Vincent Lamouroux / photo : Guillaume Onimus\",\"artiste\":\"Vincent  Lamouroux\",\"latitude\":\"48.9261\",\"longitude\":\"5.4281\",\"titre\":\"Aire 23\",\"Siteville\":\"Ville\",\"url\":\"http://publicartmuseum.net/wiki/Aire_23_(Vincent__Lamouroux)\"}");
