		obj = new JSONObject("{\"id\":\"4987\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"precision_materiaux\":\"Peinture à l'huile\",\"materiaux\":\"peinture, toile\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Noel Varoqui peint sur de grandes toiles la forêt, les blessures du temps, la terre insoumise, la caducité des choses et le corps qui se meurt. Il explore en nomade les traces de la guerre sur cet arrière front telles que anciennes sapes et des tombes provisoires. Noel Varoqui décline dans ses peintures le motif du pli, cette forme indéfinie qui est à la fois la signature du vivant et sa trace. Il fouille les méandres, les Replis de ces lieux où il a séjourné et avec lesquels la matière même de sa peinture finit par se confondre.\",\"image_principale\":\"2014_07_17_installation_peinture_foret_191_varoqui_replis_vdf2014_©marine_calamai_(3).jpg\",\"creditphoto\":\"credits: Noel Varoqui / Photo : Marine Calamai\",\"artiste\":\"Noel Varoqui\",\"latitude\":\"48.9146\",\"longitude\":\"5.4151\",\"titre\":\"Replis\",\"url\":\"http://publicartmuseum.net/wiki/Replis_(Noel_Varoqui)\"}");
