		obj = new JSONObject("{\"id\":\"4986\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"precision_materiaux\":\"Planches de chêne\",\"couleur\":\"vert\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2012\",\"description\":\"Ernesto Sartori loge dans l'obscurité d'un sous-bois une cellule composée de pans inclinés et colorés. Cette sculpture repose sur l'agencement d’éléments triangulaires qui suivent un angle, une pente précise. Ce jeu de cloisonnement semble faire partie d'un système architectural plus vaste, qui a ses lois, son fonctionnement propre, tendu entre une grande rigueur mathématique et la fantaisie d’un univers de science-fiction, de mondes imaginaires et enfantins.\",\"image_principale\":\"2012_179_Ernesto_Sartori,_Quand_deux_vaisseaux_deviennent_un,_VdF_2012,_-®Camille_Hofgaertner.jpg\",\"creditphoto\":\"credits: Ernesto Sartori / Photo : Camille Hofgaertner\",\"artiste\":\"Ernesto Sartori\",\"latitude\":\"48.9206\",\"longitude\":\"5.4462\",\"titre\":\"Quand deux vaisseaux deviennent un\",\"url\":\"http://publicartmuseum.net/wiki/Quand_deux_vaisseaux_deviennent_un_(Ernesto_Sartori)\"}");
