		obj = new JSONObject("{\"id\":\"4985\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Nicey-sur-Aire\",\"Sitenom\":\"Forêt communale de Nicey\",\"mot_cle\":\"14-18\",\"longueur\":\"2\",\"hauteur\":\"4,7\",\"materiaux\":\"acier, peinture\",\"couleur\":\"kaki\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Miguel-Angel Molina peint une plaque d’acier de 4 x 3 m aux couleurs bariolées des treillis militaires. Le motif du camouflage, emprunté ici à l'inventeur de la veste 'léopard', le peintre lorrain membre de l’Ecole de Nancy Louis Guingot, servit dans un premier temps à dissimuler l’artillerie pendant la Première Guerre mondiale. Paradoxalement, l’artiste choisit pour format de son tableau les dimensions utilisées pour les affiches publicitaires, opposant ainsi deux volontés contradictoires : se cacher et se montrer, un jeu ambivalent qui est celui de guerrier, du chasseur, de l’animal.\",\"image_principale\":\"2004_110_Miguel-Angel_MOLINA_3_X_4_-_12.jpg\",\"creditphoto\":\"credits: \",\"artiste\":\"Miguel-Angel Molina\",\"latitude\":\"48.9108\",\"longitude\":\"5.3865\",\"titre\":\"3 × 4 - 12\",\"url\":\"http://publicartmuseum.net/wiki/3_%C3%97_4_-_12_(Miguel-Angel_Molina)\"}");
