		obj = new JSONObject("{\"id\":\"4982\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Rupt-devant-Saint-Mihiel\",\"hauteur\":\"7\",\"precision_materiaux\":\"Bois, fer, groisils de crisal, coloquintes, mousse expansée\",\"couleur\":\"blanc, bleu, jaune, violet\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2006\",\"description\":\"Jean-François Chevalier dresse Le mât de cocagne isolé en bordure de la route de Pierrefitte-sur-Aire. Cette attraction des fêtes de village d’autrefois est entièrement recouverte de bris de verre qui le rendent impraticable. Ce totem d’une époque révolue marie la subtilité des éclats colorés à la rudesse, l’archaïsme du support, et traduit une nostalgie, comme un désenchantement.\",\"image_principale\":\"Jean_François_Chevalier_matdecocagne_125_vdf2006.JPG\",\"creditphoto\":\"credits: Jean-François Chevalier / Photo : VdF\",\"artiste\":\"Jean-François Chevalier\",\"latitude\":\"48.8923\",\"longitude\":\"5.4\",\"titre\":\"Le mât de cocagne et ses engins\",\"url\":\"http://publicartmuseum.net/wiki/Le_m%C3%A2t_de_cocagne_et_ses_engins_(Jean-Fran%C3%A7ois_Chevalier)\"}");
