		obj = new JSONObject("{\"id\":\"4981\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"hauteur\":\"1,1\",\"precision_materiaux\":\"Pierre calcaire, lettres gravées et dorées à la feuille\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2006\",\"description\":\"Frédérique Lecerf dresse une pierre commémorative gravée comme trace de deux moments chaleureux partagés avec les habitants : un feu d’artifice monochrome or et un banquet proposant des mets dorés. Cette œuvre immortalise un souvenir collectif à chérir, un instant de nostalgie, une fête païenne qui évoque un « Âge d’Or » possible mais révolu dont il ne reste que l’empreinte.\",\"image_principale\":\"2006_127_Fr+®d+®rique_LECERF_Pierre_dor+®e.jpg\",\"creditphoto\":\"credits: Frédérique Lecerf / Photo VdF\",\"artiste\":\"Frédérique Lecerf\",\"latitude\":\"48.9249\",\"longitude\":\"5.444\",\"titre\":\"Pierre dorée\",\"url\":\"http://publicartmuseum.net/wiki/Pierre_dor%C3%A9e_(Fr%C3%A9d%C3%A9rique_Lecerf)\"}");
