		obj = new JSONObject("{\"id\":\"4978\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitedetails\":\"En bordure du chemin empierré\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"precision_materiaux\":\"Chaussures, clous, gravier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Sanaz Azari aligne 150 paires de chaussures prêtes pour une marche aux allures militaires mais figées dans l’attente d'un hypothétique départ, les migrants étant sans cesse partagés entre le mouvement et l’impossibilité de se déplacer. Dégradées par le temps qui passe et les intempéries, elles symbolisent le tragique associé à l’exode et soulignent toutes les pertes engendrées par l’immigration que l’artiste iranienne a connue.\",\"image_principale\":\"2007_132_Sanaz_AZARI_Immigrare_I.jpg\",\"creditphoto\":\"credits: Sanaz Azari / Photo : VdF\",\"artiste\":\"Sanaz Azari\",\"latitude\":\"48.9377\",\"longitude\":\"5.4387\",\"titre\":\"Immigrare I\",\"url\":\"http://publicartmuseum.net/wiki/Immigrare_I_(Sanaz_Azari)\"}");
