		obj = new JSONObject("{\"id\":\"4977\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"longueur\":\"5 m\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Ibaï Hernandorena installe dans un sous-bois un objet hybride entre le tapis volant et la serviette de plage. Il propose aux marcheurs un fauteuil paysagé en bois pour faire une halte, un micro-espace dégagé du sol, en suspension, pour s’allonger, se délasser, rêver, observer le paysage environnant d’un point de vue différent.\",\"image_principale\":\"2007_oeuvre_seule_135_ibai_hernandorena_flying_carpet_vdf2007_©claude_teter(9).JPG\",\"creditphoto\":\"credits: Ibai Hernandorena / Photo : Claude Teter\",\"artiste\":\"Ibaï Hernandorena\",\"latitude\":\"48.9118\",\"longitude\":\"5.3819\",\"titre\":\"Flying Carpet (L)\",\"url\":\"http://publicartmuseum.net/wiki/Flying_Carpet_%28L%29_(Iba%C3%AF_Hernandorena)\"}");
