		obj = new JSONObject("{\"id\":\"4976\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"precision_materiaux\":\"Tronc de cerisier, pate à bois, peinture acrylique, vernis marin\",\"materiaux\":\"bois, vernis\",\"couleur\":\"blanc, bleu\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Katarina Kudelova décore le tronc d’un cerisier déraciné aux motifs de la faïence traditionnelle slovaque. Elle enjolive la surface de la souche avec cette expression du folklore de son pays natal, faisant contraster les ornements avec la forme torturée. Elle affirme une volonté de ré-enchantement qui persiste chez les migrants malgré le déchirement qu’elle a connu lorsqu’elle a fui son pays.\",\"image_principale\":\"2007_136bis_Katarina_KUDELOVA_Racines.jpg\",\"creditphoto\":\"credits: Katarina Kudelova / Photo : VdF\",\"artiste\":\"Katarína Kúdelová\",\"latitude\":\"48.9282\",\"longitude\":\"5.3901\",\"titre\":\"Racines\",\"url\":\"http://publicartmuseum.net/wiki/Racines_(Katar%C3%ADna_K%C3%BAdelov%C3%A1)\"}");
