		obj = new JSONObject("{\"id\":\"4975\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitedetails\":\"Forêt communale de Pierrefitte\",\"longueur\":\"100 m\",\"hauteur\":\"150 cm\",\"precision_materiaux\":\"Fil de fer barbelé, piquets d'accacia, leurres de chasse, peinture\",\"couleur\":\"rouge\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Katrina Kudelova emprisonne cent leurres de chasse peints en rouge dans une clôture de barbelés le long d’un chemin. Ces oiseaux symboliquement ensanglantés piégés dans les fils meurtriers évoquent un Peuple migrateur à la beauté fragile et au destin brisé. A l’image de l’artiste quittant, enfant, sa terre natale slovaque.\",\"image_principale\":\"Katarina_Kudelova_Peuple_Migrateur_VdF2007_credit_inconnu.JPG\",\"creditphoto\":\"credits: Katarina Kudelova / Photo : VdF\",\"artiste\":\"Katarína Kúdelová\",\"latitude\":\"48.9197\",\"longitude\":\"5.3909\",\"titre\":\"Peuple migrateur\",\"url\":\"http://publicartmuseum.net/wiki/Peuple_migrateur_(Katar%C3%ADna_K%C3%BAdelov%C3%A1)\"}");
