		obj = new JSONObject("{\"id\":\"4974\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"hauteur\":\"1,5\",\"precision_materiaux\":\"Dibond miroir\",\"materiaux\":\"bois, miroir\",\"couleur\":\"jaune\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Fabien Lerat installe en pleine forêt une sculpture kaléidoscope à la surface extérieure réfléchissante, les parois intérieures jaunes, et au fond de laquelle se trouve un miroir. La couleur primaire intense vise à se marier au bleu du ciel pour créer la couleur complémentaire verte, celle de la forêt. Cette œuvre reflète autant le paysage environnant que le promeneur qui peut expérimenter ses différentes facettes. La pluie qui la traverse crée un petit bassin de rétention, une Fontaine, ce qui élargit le spectre des sensations qu’elle procure.\",\"image_principale\":\"2007_07_oeuvre_seule_137_fabien_lerat_fontaine_vdf2007_©claude_teter(5).JPG\",\"creditphoto\":\"credits: Fabien Lerat / Photo : Claude Teter\",\"artiste\":\"Fabien Lerat\",\"latitude\":\"48.9342\",\"longitude\":\"5.4305\",\"titre\":\"Fontaine\",\"url\":\"http://publicartmuseum.net/wiki/Fontaine_(Fabien_Lerat)\"}");
