		obj = new JSONObject("{\"id\":\"4973\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"precision_materiaux\":\"Tôle ondulée, Tuyaux en acier galvanisé, Colliers galvanisés\",\"materiaux\":\"acier\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2008\",\"description\":\"Clément Laigle construit des toits en tôle soutenus par des structures métalliques. L’ensemble a pour fonction d’abriter des œuvres anciennes comme les appentis des sites de fouilles archéologiques, ici l’œuvre de Walther Piesch Lieu de rêve. Cette intervention évoque aussi bien une sauvegarde, une réparation, qu’une mise en exergue voire une appropriation. Das Adlernest, le nid d’aigle, est un refuge inaccessible qui protège, met à l’abri ; et fait également écho au nom de l’artiste.\",\"image_principale\":\"Clement_Laigle_Das_Adlernest_VdF2008_credit_inconnu_2008_07_(9).JPG\",\"creditphoto\":\"credits: Clément Laigle / Photo : VdF\",\"artiste\":\"Clément Laigle\",\"latitude\":\"48.9281\",\"longitude\":\"5.4398\",\"titre\":\"Das Adlernest\",\"url\":\"http://publicartmuseum.net/wiki/Das_Adlernest_(Cl%C3%A9ment_Laigle)\"}");
