		obj = new JSONObject("{\"id\":\"4884\",\"proprietaire\":\"National Park Service\",\"Sitepmr\":\"je ne sais pas\",\"Sitepays\":\"États-Unis\",\"Siteville\":\"New York\",\"Sitedetails\":\"Patrimoine mondial (1984)\",\"Sitenom\":\"Liberty Island\",\"mot_cle\":\"liberté\",\"hauteur\":\"46,05\",\"contexte_production\":\"L'idée d'un présent en gage de l'amitié franco-américaine et pour célébrer le centenaire de la déclaration d'indépendance des États-Unis est attribuée au politicien et historien Édouard de Laboulaye, auteur de Paris en Amérique et des Contes Bleus. Laboulaye, devenu le leader d'un groupe libéral de républicains américanistes après la mort d'Alexis de Tocqueville, organise le 21 avril 1865 un dîner clandestin à Glatigny dont la raison officielle est de célébrer la victoire de l'Union dans la guerre de Sécession (bataille d'Appomattox Court House en avril 1865) alors que les États-Unis sont en pleine période de reconstruction et à l'aube du Gilded Age, c'est-à-dire de la « période dorée ».\",\"nature\":\"pérenne\",\"inauguration\":\"1886 \",\"description\":\"La Liberté éclairant le monde (Liberty Enlightening The World), plus connue sous le nom de Statue de la Liberté (Statue of Liberty), est l'un des monuments les plus célèbres des États-Unis. Cette statue monumentale est située à New York, sur l'île de Liberty Island au sud de Manhattan, à l'embouchure de l'Hudson et à proximité d'Ellis Island. Elle fut construite en France et offerte par le peuple français, en signe d'amitié entre les deux nations, pour célébrer le centenaire de la Déclaration d'indépendance américaine. La statue fut découverte au grand jour le 28 octobre 1886 en présence du président des États-Unis, Grover Cleveland. L'idée venait du juriste et professeur au Collège de France Édouard de Laboulaye, en 1865. Le projet fut confié, en 1871, au sculpteur français Auguste Bartholdi. Pour le choix des cuivres devant être employés à la construction, l'architecte Eugène Viollet-le-Duc eut l'idée de la technique du repoussé. En 1879, à la mort de Viollet-le-Duc, Bartholdi fit appel à l'ingénieur Gustave Eiffel pour décider de la structure interne de la statue. Ce dernier imagina un pylône métallique supportant les plaques de cuivre martelées et fixées.\",\"image_principale\":\"Estatua_de_La_Libertad.jpg\",\"creditphoto\":\"credits: Domaine public / Source : https://commons.wikimedia.org/wiki/File:Estatua_de_La_Libertad.jpg\",\"artiste\":\"Auguste Bartholdi, Gustave Eiffel\",\"latitude\":\"40.689758\",\"longitude\":\"-74.04513800000001\",\"titre\":\"Liberté éclairant le monde\",\"url\":\"http://publicartmuseum.net/wiki/Libert%C3%A9_%C3%A9clairant_le_monde_(Auguste_Bartholdi%2C_Gustave_Eiffel)\"}");
