		obj = new JSONObject("{\"id\":\"4783\",\"Sitepmr\":\"je ne sais pas\",\"Sitepays\":\"France\",\"Siteregion\":\"Pays de la Loire\",\"Siteville\":\"Frossay\",\"Sitenom\":\"Le Carnet\",\"materiaux\":\"acier, informatique\",\"couleur\":\"noir\",\"contexte_production\":\"Estuaire 2009 ; I.C.I. ! Instant Carnet Island: rassemblement de micro-architectures et habitats légers. I.C.I. est un refuge temporaire en bord de Loire pour expérimenter des micro-architectures. I.C.I. fait référence à “Instant City”, projet de ville nomade imaginé par les architectes anglais Archigram à la fin des années 1960. \",\"nature\":\"éphémère\",\"inauguration\":\"2009\",\"description\":\"Sur le site du Carnet est présentée l’une des pièces centrales d’Ant Farm : une version réactualisée du Media Van. Le Media Van est un van Chevrolet modifié en studio mobile, diffusant informations et images, transportant les matériaux utilisés pour leurs architectures gonflables. Ressemblant à l’époque à un véhicule lunaire avec ses coques en plastique sur le toit, le Media Van visait à promouvoir une architecture alternative et sera un outil privilégié dans leur nomadisme militant, imprégné des modes de vie de la contre-culture. Media Van fonctionne aujourd’hui comme une “capsule temporelle”. Le public est invité à y consulter des archives vidéo mais aussi à les enrichir en faisant don de sons et d’images numériques.\",\"latitude\":\"47.283261988676\",\"longitude\":\"-1.9798552393695\",\"titre\":\"Media Van\",\"image_principale\":\"2009_instant_carnet_island.jpg\",\"creditphoto\":\"credits: © Antfarm /photo: © Stéphane Bellanger / source: http://www.estuaire.info/fr/oeuvre/i-c-i-instant-carnet-island-rassemblement-de-micro-architectures-et-habitats-legers/\",\"artiste\":\"Ant Farm\",\"url\":\"http://publicartmuseum.net/wiki/Media_Van_(Ant_Farm)\"}");
