		obj = new JSONObject("{\"id\":\"4752\",\"Sitepmr\":\"je ne sais pas\",\"Sitepays\":\"France\",\"Siteregion\":\"Pays de la Loire\",\"Siteville\":\"Saint-Jean-de-Boiseau\",\"Sitedetails\":\"La chapelle de Bethléem datée du XVe siècle, de style gothique flamboyant, a été classée lors de l’inventaire des monuments historiques de 1911. Les contreforts sont coiffés de pinacles ornés de chimères. Dans les années 1990, ces chimères ont été restaurées à l’identique, sauf pour l’un des piliers où il n’existait aucun document iconographique. Ces chimères ont été remplacées par des sculptures modernes : le pilier sud-ouest (pinacle de l’inconscient) est orné de trois chimères qui représentent Goldorak, deux Gremlins dont le gentil Guizmo, symboles modernes de la lutte entre les pulsions du bien et du mal.\",\"Sitenom\":\"Chapelle de Bethléem\",\"contexte_production\":\"Estuaire 2009\",\"nature\":\"éphémère\",\"inauguration\":\"2009\",\"description\":\"D’Io, créée en 1971, est une installation sonore. Lorsque le spectateur arrive aux abords de la chapelle, il est surpris par un rire tonitruant et insistant, qui n’est autre que celui de l’artiste. Avec cette œuvre, Gino de Dominicis joue avec le mot “d’Io”, qui peut signifier “dieu” ou “moi” en italien, et semble ainsi ironiser sur l’idée de l’artiste démiurge. \",\"latitude\":\"47.1954\",\"longitude\":\"-1.73157\",\"titre\":\"D'io\",\"image_principale\":\"2009_d_io.jpg\",\"creditphoto\":\"credits: photo: © Stéphane Bellanger\",\"artiste\":\"Gino de Dominicis\",\"url\":\"http://publicartmuseum.net/wiki/D%27io_(Gino_de_Dominicis)\"}");
