		obj = new JSONObject("{\"id\":\"4633\",\"proprietaire\":\"Frac Limousin\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"precision_materiaux\":\"Béton 50 x 230 x 63 cm\",\"materiaux\":\"béton\",\"contexte_production\":\"Commande du Centre d'art en 2005.\",\"nature\":\"pérenne\",\"description\":\"La célèbre sculpture de Maillol, Hommage à Cézanne fut commandée en 1912 par un comité d’artistes d’Aix-en-Provence. Pour Maillol, cette composition classique qui représentait une statue de femme vêtue, portant une branche d’olivier, était la meilleure manière d’évoquer la peinture. L’œuvre fut installée au Jardin des Tuileries puis déplacée près du Louvre sans son socle d’origine et attribuée au Musée d’art moderne de la ville de Paris. En se promenant dans le Jardin des Tuileries, Olivier Mosset découvre le socle abandonné avec l'inscription 'A Paul Cézanne'.  Il fit répliquer cette pierre à Bienne. Dans le cadre d'une exposition au Centre international d’art et du paysage de l’île de Vassivière en 2004, il a souhaité présenter cette œuvre qui signe de façon commune le paysage à la fois par Paul Cézanne et par Olivier Mosset.\",\"latitude\":\"45.801886\",\"longitude\":\"1.8661090000001\",\"titre\":\"A Paul Cézanne\",\"image_principale\":\"Mosset_Vassiviere.jpg\",\"creditphoto\":\"credits: © Olivier Mosset / photo: T.Delamarre\",\"artiste\":\"Olivier Mosset\",\"Siteville\":\"Ville\",\"url\":\"http://publicartmuseum.net/wiki/A_Paul_C%C3%A9zanne_(Olivier_Mosset)\"}");
