		obj = new JSONObject("{\"id\":\"4474\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Pays de la Loire\",\"Siteville\":\"Nantes\",\"Sitenom\":\"Bâtiment Manny\",\"proprietaire\":\"Groupe Coupechoux\",\"mouvement_artistes\":\"art sonore, fluxus\",\"contexte_production\":\"Estuaire 2009/ \",\"nature\":\"pérenne\",\"inauguration\":\"2009\",\"description\":\"Dans son travail, Rolf Julius cherchait inlassablement à mettre au jour la relation entre musique et sculpture, ou comment créer de « la musique pour les yeux », titre d’une de ses compositions. Le promeneur passant à proximité de Manny découvre Air, qui sous la peau métallique du bâtiment, telle « une douce musique pour les murs », résonne et semble subtilement « rendre audible la façade ». Entre cliquetis métalliques et vagues chants d’oiseaux, cette musique sourde et discrète renvoie à l’environnement immédiat du bâtiment. En s’appropriant le son comme matière, Rolf Julius a cherché à substituer le son à l’image pour réduire l’importance du sens de la vue et équilibrer les perceptions sensibles.\",\"latitude\":\"47.2069\",\"longitude\":\"-1.5607\",\"titre\":\"Air\",\"image_principale\":\"Air-rolf-julius-320377.jpg\",\"creditphoto\":\"credits: © Rolf Julius / architecte: Tetrarc/ source image: http://m.nantes-tourisme.com/sites/default/files/flux/air-rolf-julius-320377.jpg\",\"artiste\":\"Rolf Julius\",\"url\":\"http://publicartmuseum.net/wiki/Air_(Rolf_Julius)\"}");
