		obj = new JSONObject("{\"id\":\"4465\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"Jeu\",\"precision_materiaux\":\"Panneaux contreplaqué, Dibond miroir, sangles, arbres\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2006\",\"description\":\"Lorentino a recours au procédé de représentation le plus direct : un grand miroir panoramique dont il extrait les lettres du mot 'cachée'. Ces lettres sont agencées dans une partie de forêt dégagée et reconstitue le mot dans l'espace, visible grâce à la réflexion du paysage sur la surface. L'oeuvre Cachée apparaît donc uniquement dans ce contexte et dialogue avec la matrice du miroir évidée dans une autre partie de la forêt.\",\"image_principale\":\"Lorentino_Cachee_bis_VdF2006_credit_Camille_Hofgaertner_2012_06_(11).jpg\",\"creditphoto\":\"credits: Lorentino / photo: Camille Hofgaertner\",\"artiste\":\"Lorentino\",\"latitude\":\"48.928214\",\"longitude\":\"5.397969\",\"titre\":\"Cachée\",\"url\":\"http://publicartmuseum.net/wiki/Cach%C3%A9e_(Lorentino)\"}");
