		obj = new JSONObject("{\"id\":\"4464\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"mot_cle\":\"lettre, jeu\",\"hauteur\":\"1,80\",\"precision_materiaux\":\"Panneaux contreplaqués, Dibond miroir\",\"materiaux\":\"bois, plexiglas\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2006\",\"description\":\"Lorentino a recours au procédé de représentation le plus direct : un grand miroir panoramique en plexiglas dont il extrait les lettres du mot 'cachée'. C'est paradoxalement grâce à la partie évidée, absente, que l'oeuvre est visible, elle apparaît grâce à la réflexion du paysage sur la surface. Les lettres issues de la découpe sont dispersées dans une autre partie de la forêt, ce qui crée un espace virtuel, un lien entre les deux œuvres et questionne habilement l'idée de vide et de plein.\",\"image_principale\":\"Lorentino_Cachee_VdF2006_credit_VdF_2006_07_(19).JPG\",\"creditphoto\":\"credits: Lorentino / photo: VdF\",\"artiste\":\"Lorentino\",\"latitude\":\"48.93668898\",\"longitude\":\"5.4431629926\",\"titre\":\"Cachée\",\"url\":\"http://publicartmuseum.net/wiki/Cach%C3%A9e_(Lorentino)\"}");
