		obj = new JSONObject("{\"id\":\"4463\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Bois de Dompcevrin\",\"precision_materiaux\":\"Acacia\",\"materiaux\":\"bois\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1997\",\"description\":\"Marek Borsanyi installe à l’entrée de la forêt un être, ni humain ni animal, qui se dresse vers le ciel pour voir au-dessus des arbres, jusqu’à Dompcevrin ; il guette et observe la forêt et ses alentours. Le titre annonce un Gardien, protecteur et bienfaisant, un être à trois pattes, fétiche ou totem des promeneurs.\",\"image_principale\":\"Marek_Borsanyi_Gardien_VdF1997_credit_Pascal_Ruwet-2007-08(2).JPG\",\"creditphoto\":\"credits: Marek Borsanyi / photo: Pascal Ruwet\",\"artiste\":\"Marek Borsányi\",\"latitude\":\"48.92500897\",\"longitude\":\"5.4727739934\",\"titre\":\"Gardien\",\"url\":\"http://publicartmuseum.net/wiki/Gardien_(Marek_Bors%C3%A1nyi)\"}");
