		obj = new JSONObject("{\"id\":\"4462\",\"precision_etat_conservation\":\"mousses/champignons/dépôts naturels\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitedetails\":\"En bordure du chemin empierré\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"materiaux\":\"pierre\",\"couleur\":\"gris, or\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"1998\",\"description\":\"Daniel Denise invite le promeneur à prendre place sur ce mobilier de pierre gravé en lettre d’or du mot « EGO ». L’œuvre est positionnée pour contempler le théâtre du monde, confortablement assis sur son ego.\",\"image_principale\":\"2003_oeuvre_seule_024_Daniel_Denise_Ego_vdf1998_©Claude_Teter_(5).jpg\",\"creditphoto\":\"credits: Daniel Denise / photo: Claude Teter\",\"artiste\":\"Daniel Denise\",\"latitude\":\"48.93159396\",\"longitude\":\"5.4034160078\",\"titre\":\"Ego\",\"url\":\"http://publicartmuseum.net/wiki/Ego_(Daniel_Denise)\"}");
