		obj = new JSONObject("{\"id\":\"4461\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt domaniale de Marcaulieu\",\"mot_cle\":\"Exode ; Histoire\",\"precision_materiaux\":\"Toitures  de voitures, frêne, cordes, languettes cuir, objets divers, lanières métalliques (coffres/valises), portes bagages métal\",\"materiaux\":\"bois, cuir, métal\",\"couleur\":\"blanc, bleu, gris, noir, rouge\",\"nature\":\"éphémère\",\"inauguration\":\"2002\",\"description\":\"Joël Thépault rend hommage à l’exode connu par les villages lors de la Première Mondiale en abandonnant, à moitié sous terre, une ligne de huit voitures des années 1970 à 1980. Les bagages accrochés sur les toits témoignent d’une fuite soudaine des villageois. Une oeuvre sur l'épreuve du départ, provisoire ou définitif, que les populations des territoires en guerre endurent invariablement.\",\"image_principale\":\"2003_02_oeuvre_seule_088_thepault_exode_vdf2002_©inconnu.JPG\",\"creditphoto\":\"credits: Joël Thépault / photo: VdF\",\"artiste\":\"Joël Thépault\",\"latitude\":\"48.92541599\",\"longitude\":\"5.4226219654\",\"titre\":\"Exode\",\"url\":\"http://publicartmuseum.net/wiki/Exode_(Jo%C3%ABl_Th%C3%A9pault)\"}");
