		obj = new JSONObject("{\"id\":\"4460\",\"autre_precision_etat_conservation\":\"peinture légèrement ternie.\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefite\",\"mot_cle\":\"Carte de France, relief\",\"hauteur\":\"3\",\"precision_materiaux\":\"Plaques et tubes métalliques, peinture\",\"materiaux\":\"métal\",\"couleur\":\"orange\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2004\",\"description\":\"Aï Kitahara modélise en trois dimensions la carte de France et nous invite à toucher son contour. Interrogeant la notion de territoire, 7,5m² de frontière est une sculpture qui délimite matériellement et symboliquement un espace qui devient frontière. Un questionnement topologique qui repense et bouscule l'échelle de nos représentations.\",\"image_principale\":\"AI_KITAHARA_7,5_m2_de_frontière.jpg\",\"creditphoto\":\"credits: Ai Kitahara / photo: VdF\",\"artiste\":\"Ai Kitahara\",\"latitude\":\"48.91478296\",\"longitude\":\"5.3757920209\",\"titre\":\"7,5 m² de frontière\",\"url\":\"http://publicartmuseum.net/wiki/7%2C5_m%C2%B2_de_fronti%C3%A8re_(Ai_Kitahara)\"}");
