		obj = new JSONObject("{\"id\":\"4459\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"mot_cle\":\"Batonnets, Mikado, tempête\",\"hauteur\":\"5\",\"precision_materiaux\":\"Sapin, peinture acrylique\",\"couleur\":\"bleu, jaune, rouge\",\"nature\":\"éphémère\",\"inauguration\":\"2005\",\"description\":\"François Génot simule par un jeu de Mikado géant le désordre causé par une tempête, celle qui a frappé la forêt en 1999 : arbres tombés, enchevêtrés et à ramasser pour laisser vivre ceux qui ont survécu. La forme de l’œuvre repose sur l’équilibre fragile des bâtonnets, nous rappelant que dans la nature chaque partie est liée au tout.\",\"image_principale\":\"Francois_Genot_Entrelacs_fratras_VdF2005_credit_inconnu_2006_06.JPG\",\"creditphoto\":\"credits: François Genot / photo: VdF\",\"artiste\":\"François Génot,\",\"latitude\":\"48.92470202\",\"longitude\":\"5.3625849914\",\"titre\":\"Entrelacs 2 (fatras)\",\"url\":\"http://publicartmuseum.net/wiki/Entrelacs_2_%28fatras%29_(Fran%C3%A7ois_G%C3%A9not%2C)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"4458\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"granit noir ; reflets ; pierre tombale, vertige, Miroir, narcisse\",\"precision_materiaux\":\"granit noir, dorure\",\"materiaux\":\"feuille d'or, granit\",\"couleur\":\"noir, or\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Edouard Boyer grave sur une plaque de granit noir l’inscription « je me suis levé à 18h49 – 15 juil. 2007 », trace d'une performance qui a eu lieu à cette date. Sur la surface polie, les reflets des arbres et du ciel se mêlent à celui du visiteur suscitant une sorte de vertige, un questionnement existentiel devant ce simili de pierre tombale qui évoque le passage de la vie à trépas à la façon d’une vanité contemporaine.\",\"image_principale\":\"2014-10-24_oeuvre_seule_133_boyer_jemesuislevé_vdf2007©marie-céline-henry_(3).JPG\",\"creditphoto\":\"credits: Édouard Boyer / photo: Marie céline Henry\",\"artiste\":\"Édouard Boyer\",\"latitude\":\"48.924869\",\"longitude\":\"5.393542\",\"titre\":\"Station - Je me suis levé\",\"url\":\"http://publicartmuseum.net/wiki/Station_-_Je_me_suis_lev%C3%A9_(%C3%89douard_Boyer)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"4457\",\"autre_precision_etat_conservation\":\"gravure à redorer ( disparaît avec le temps )\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"granit noir, reflets, miroir, pierre tombale, Narcisse\",\"precision_materiaux\":\"granit noir, dorure\",\"materiaux\":\"feuille d'or, granit, pierre\",\"couleur\":\"noir, or\",\"mouvement_artistes\":\"art in situ, performance artistique\",\"nature\":\"éphémère\",\"inauguration\":\"2007\",\"description\":\"Edouard Boyer dispose dans la forêt une plaque de granit noir gravée des mots « Je suis toujours vivant ». Le promeneur voit son image et le paysage environnant s'y refléter comme dans un miroir, provoquant une sorte de vertige, un questionnement existentiel. Inspiré du travail de l’artiste On Kawara qui envoyait à travers le monde des cartes postales affichant le message « I’m still alive » ou « I got up at… » suivi de l’heure exacte, Edouard Boyer évoque par ce simili de pierre tombale le passage de la vie au trépas et fait de l’œuvre une vanité contemporaine.\",\"image_principale\":\"2007_133_Edouard_BOYER_STATION_Je_suis_toujours_vivant.jpg\",\"creditphoto\":\"credits: Édouard Boyer / photo: VdF\",\"artiste\":\"Édouard Boyer\",\"latitude\":\"48.92570601\",\"longitude\":\"5.398865975\",\"titre\":\"Station - Je suis toujours vivant\",\"url\":\"http://publicartmuseum.net/wiki/Station_-_Je_suis_toujours_vivant_(%C3%89douard_Boyer)\"}");
