		obj = new JSONObject("{\"id\":\"4456\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Nicey-sur-Aire\",\"Sitedetails\":\"prairie au centre du village de Nicey-sur-Aire\",\"Sitenom\":\"Village de Nicey-sur-Aire\",\"mot_cle\":\"pince à linge, sculpture\",\"hauteur\":\"6\",\"precision_materiaux\":\"poutres de bois de peuplier\",\"materiaux\":\"bois, fer, résine\",\"nature\":\"éphémère\",\"inauguration\":\"2008\",\"description\":\"Mehmet Ali Uysal met en scène la surface d'une prairie, la rend sensible, palpable. La sculpture s’inscrit dans l’interaction entre le pincement de la couche supérieure de la pelouse et le soulèvement de celle-ci par une pince à linge de six mètres de haut. La mise en situation d’un objet du quotidien transforme l’ensemble du lieu en une peau fragile à la merci de toutes les dégradations.\",\"image_principale\":\"Mehmet_Ali_Uysal_Skin_VdF2008_credit_VdF_2011_04_(18).jpg\",\"creditphoto\":\"credits: Mehmet Ali Uysal / photo: VdF\",\"artiste\":\"Mehmet Ali Uysal\",\"latitude\":\"48.88374503\",\"longitude\":\"5.3340270091\",\"titre\":\"Skin\",\"url\":\"http://publicartmuseum.net/wiki/Skin_(Mehmet_Ali_Uysal)\"}");
