		obj = new JSONObject("{\"id\":\"4454\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitedetails\":\"deux vergers de mirabelliers surplombant le village de Lahaymeix, en bordure de la route départementale D101.\",\"precision_materiaux\":\"Chêne de première qualité dit à 'merrain', créosote, huile de lin\",\"materiaux\":\"bois\",\"couleur\":\"noir\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2009\",\"description\":\"Christian Lapie sculpte dix imposantes silhouettes humaines calcinées, toutes extraites d'un même chêne. Ses figures intemporelles dressées dans un verger de mirabelliers sur la route de Lahaymaix, imposent une présence silencieuse et protectrice en surplomb du village. Un dialogue fécond s'établit entre les formes immobiles et le paysage changeant, entre cette statuaire universelle et les humains qui s'y reconnaissent individuellement et collectivement.\",\"image_principale\":\"2014_04_09_oeuvre_seule_153_lapie_le_silence..._vdf2009_©morgane_rul_(2).JPG\",\"creditphoto\":\"credits: Christian Lapie / photo: Morgane Rul\",\"artiste\":\"Christian Lapie\",\"latitude\":\"48.937466\",\"longitude\":\"5.415463\",\"titre\":\"Le Silence divisé\",\"url\":\"http://publicartmuseum.net/wiki/Le_Silence_divis%C3%A9_(Christian_Lapie)\"}");
