		obj = new JSONObject("{\"id\":\"4452\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"mot_cle\":\"mathèmatiques, théorème des dictateurs\",\"precision_materiaux\":\"Épicéa\",\"materiaux\":\"acier, bois, vernis\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2009\",\"description\":\"Vincent Mauger érige une sphère autoritaire et défensive composée de pics menaçants jaillis d'un unique point, le principe d'assemblage complexe de cette sculpture engendrant de fortes contraintes de construction. La troublante structure du Théorème des Dictateurs emprunte son nom à un économiste qui a théorisé les rapports entre mathématique et politique.\",\"image_principale\":\"Vincent_Mauger_Le_theoreme_des_dictateurs_VdF2009_credit_Guillaume_Ramon_2013_07_19_(1).JPG\",\"creditphoto\":\"credits: Vincent Mauger / photo: Guillaume Ramon\",\"artiste\":\"Vincent Mauger\",\"latitude\":\"48.933821\",\"longitude\":\"5.47777\",\"titre\":\"Le Théorème des dictateurs\",\"url\":\"http://publicartmuseum.net/wiki/Le_Th%C3%A9or%C3%A8me_des_dictateurs_(Vincent_Mauger)\"}");
