		obj = new JSONObject("{\"id\":\"4447\",\"precision_etat_conservation\":\"mousses/champignons/dépôts naturels\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"légende\",\"hauteur\":\"3,50\",\"precision_materiaux\":\"Pierre de Savonnières\",\"materiaux\":\"pierre\",\"couleur\":\"blanc\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2010\",\"description\":\"Stefan Rinck sculpte un colosse de trois mètres de haut aux dents acérées. Ce géant pétrifié en pierre de Savonnière trône dans une clairière proche de Lahaymeix. Sorti tout droit de l’imaginaire, le monstre immobile devient le totem d’un géant vaincu, un jouet personnifiant les angoisses infantiles qu'il désamorce. Cette statue inoffensive et protectrice devient alors pour tous « l'ami de la forêt ».\",\"image_principale\":\"2014_05_05_oeuvre_seule_164_rinck_one_of_those..._vdf2010_©marine_calamai_(2).jpg\",\"creditphoto\":\"credits: Stefan Rinck / photo: Marine Calamai\",\"artiste\":\"Stefan Rinck\",\"latitude\":\"48.92673598\",\"longitude\":\"5.390478959\",\"titre\":\"One of those who were too long in the woods\",\"url\":\"http://publicartmuseum.net/wiki/One_of_those_who_were_too_long_in_the_woods_(Stefan_Rinck)\"}");
