		obj = new JSONObject("{\"id\":\"4443\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Nicey-sur-Aire\",\"Sitedetails\":\"au bord de la rivière Aire, entres les villages de Nicey-sur-Aire et Pierrefitte-sur-Aire\",\"mot_cle\":\"Brume, point de vue, paysage, jardin japonais\",\"precision_materiaux\":\"276 buses, 4 valves électro-magnétiques, 1 système de pompe motorisé, 1 adoucisseur d'eau, pierre de Senonville, végétaux\",\"materiaux\":\"eau, métal, pierre, végétaux\",\"mouvement_artistes\":\"art in situ\",\"contexte_production\":\"Coproduction / Collection 49 NORD 6 EST - FRAC Lorraine.\",\"nature\":\"éphémère\",\"inauguration\":\"2011\",\"description\":\"Fujiko Nakaya compose une sculpture de brume à proximité du village de Nicey-sur-Aire, sur un terrain aménagé à la manière d'un jardin japonais. Les nappes de brouillard, déclenchées suivant une partition précise, montent des deux côtés de la rivière Aire, envahissent le jardin, le traversent, se dispersent ou s'installent selon le vent, et façonnent un paysage toujours différent. Un petit chemin de copeaux et de gravier blanc mène à l'espace habité de pins, de bambous, de mousse, de plantes et de larges blocs de pierre locales, écrin d'une oeuvre qui incite à la contemplation et à la conscience de la nature.\",\"image_principale\":\"Moss_Garden_Nicey-sur-Aire,_Fujiko_Nakaya,_coprod._Le_Vent_des_Forêts-Frac_Lorraine_2011_crédit_Sébastien_Agnetti_(16).jpg\",\"creditphoto\":\"credits: Fujiko Nakaya / photo: Sébastien Agnetti\",\"artiste\":\"Fujiko Nakaya\",\"latitude\":\"48.889025\",\"longitude\":\"5.334284\",\"titre\":\"Moss Garden, Nicey-sur-Aire\",\"url\":\"http://publicartmuseum.net/wiki/Moss_Garden%2C_Nicey-sur-Aire_(Fujiko_Nakaya)\"}");
