		obj = new JSONObject("{\"id\":\"4436\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"mot_cle\":\"alchimie\",\"longueur\":\"20\",\"hauteur\":\"2,2\",\"precision_materiaux\":\"glaise\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2013\",\"description\":\"Alexandra Engelfried offre un passage halluciné de dix mètres de long aux parois martelées, craquelées, brûlées. Cette tranchée béante est la trace d'une performance : sa lutte acharnée pour modeler vingt-deux tonnes d'argile brute avec ses poings, ses genoux, ses mains. Les murs ainsi sculptés ont été pétrifiés sur place par une cuisson au bois alimentée nuit et jour. Cette œuvre témoigne de la mise à l'épreuve du corps avec la résistance et la plasticité de la terre humide et de la violence des gestes.\",\"image_principale\":\"2013_09_04_oeuvre_visiteurs_181_engelfriet_tranchee_vdf2013_©guillaume_ramon_(5).JPG\",\"creditphoto\":\"credits: Alexandra Engelfriet / photo: Guillaume Ramon\",\"artiste\":\"Alexandra Engelfriet\",\"latitude\":\"48.916781\",\"longitude\":\"5.360125\",\"titre\":\"Tranchée\",\"url\":\"http://publicartmuseum.net/wiki/Tranch%C3%A9e_(Alexandra_Engelfriet)\"}");
