		obj = new JSONObject("{\"id\":\"4435\",\"autre_precision_etat_conservation\":\"Souches noircies ; souches très humides et friables ( hiver ). Rouille.\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Fresnes-au-Mont\",\"Sitenom\":\"Forêt communale de Fresnes-au-Mont\",\"mot_cle\":\"communauté européenne\",\"precision_materiaux\":\"souches de chêne tombés sur site lors de la tempête de 1999, pièces de 1 centime d'Euro, fils de fer, étain, laiton, huile de lin\",\"materiaux\":\"acier, bois, cuivre, fer, métal\",\"couleur\":\"argent, cuivre, ébène\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2013\",\"description\":\"Lionel Sabatté sculpte une série de figures zoomorphes, qu’il fait jaillir de souches de chênes déracinées par les tempêtes de 1999, en écho à un bouleversement d'un autre ordre, l'arrivée des pièces de la nouvelle monnaie Euro en 2000. Dans l'ombre du sous-bois, cette troupe composite harnachée de soudures cuivrées et argentées, à la fois minérale, végétale, animale et humaine, symbolise une civilisation en pleine mutation.\",\"image_principale\":\"2013_183_Lionel_Sabatte_Chants_Silencieux_VdF2013_-®Guillaume_Ramon.JPG\",\"creditphoto\":\"credits: Lionel Sabatté / photo: Guillaume Ramon\",\"artiste\":\"Lionel Sabatté\",\"latitude\":\"48.911\",\"longitude\":\"5.412889\",\"titre\":\"Chants silencieux\",\"url\":\"http://publicartmuseum.net/wiki/Chants_silencieux_(Lionel_Sabatt%C3%A9)\"}");
