		obj = new JSONObject("{\"id\":\"4434\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Rupt-devant-Saint-Mihiel\",\"mot_cle\":\"écologie, recyclage, consomation, déchets, dépotoire\",\"hauteur\":\"8\",\"precision_materiaux\":\"objets usagés du quotidien, structure métallique\",\"materiaux\":\"métal, plastique\",\"nature\":\"éphémère\",\"inauguration\":\"2013\",\"description\":\"Maarten Vanden Eynde assemble sur le site d'un ancien dépotoir de village un conglomérat d’artefacts de la consommation courante en une sphère géante. Stoppée dans sa course, cette masse agglutinée, telle une collection d'objets ayant appartenu aux familles du territoire, s’érige en effigie stupéfiante de notre société moderne. Cette sculpture qui surgit du paysage explicite les enjeux écologiques contemporains et agit comme un miroir grossissant des menaces encore mésestimées qui pèsent sur une nature fragile.\",\"image_principale\":\"2014_03_28_oeuvre_seule_184_vanden_eynde_globe_vdf2013_©morgane_rul.JPG\",\"creditphoto\":\"credits: Maarten Vanden Eynde / photo: Morgane Rul\",\"artiste\":\"Maarten Vanden Eynde\",\"latitude\":\"48.883333\",\"longitude\":\"5.414194\",\"titre\":\"Globe\",\"url\":\"http://publicartmuseum.net/wiki/Globe_(Maarten_Vanden_Eynde)\"}");
