		obj = new JSONObject("{\"id\":\"4433\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"rocaille, Jacques de Lajoüe, cadre\",\"hauteur\":\"2,51\",\"precision_materiaux\":\"Ciment, fer à béton, grillage, sables divers, sikalatex, pierre de rocaille, pigments\",\"materiaux\":\"ciment, fer, métal, pierre, pierre de lave, résine\",\"couleur\":\"blanc, bleu, bordeaux, gris, noir, rose, vert, violet\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2013\",\"description\":\"Marion Verboom construit un motif architectural rocaille à double titre : par son décor exubérant de coquillages, coraux et végétaux inspiré des cartouches rococo de Jacques de Lajoüe (ornemaniste du XVIIIe siècle) et par la technique employée, celle du ciment travaillé autour de grillages, appelée au XIXème siècle « rocaille ». Elle crée ainsi en forêt un cadre enchanté aux formes opulentes et aux demi-teintes pastel.\",\"image_principale\":\"Marion_Verboom_Cartouche_VdF2013_credit_Morgane_Rul_2013_07_14_(1).jpg\",\"creditphoto\":\"credits: Marion Verboom / photo: Morgane Rul\",\"artiste\":\"Marion Verboom\",\"latitude\":\"48.924867\",\"longitude\":\"5.391058\",\"titre\":\"Cartouche\",\"url\":\"http://publicartmuseum.net/wiki/Cartouche_(Marion_Verboom)\"}");
