		obj = new JSONObject("{\"id\":\"4432\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitenom\":\"Forêt communale de Pierrefitte\",\"mot_cle\":\"verre, four, cercle\",\"precision_materiaux\":\"flaches de chêne, charbon de bois, cendre, sable, torchis, glaise, émail\",\"materiaux\":\"bois, céramique, terre, verre\",\"couleur\":\"bordeaux, noir\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Sandrine Pelletier et Olivier Ducret composent au centre d'un grand disque une partition faite d'éclats, de traces calcinées et d'éruptions verrières. La sculpture qu'ils proposent est l'achèvement d'un rituel païen où les forces de la nature et la main de l'homme ont façonné la matière brute, métamorphosée par le passage du feu et le travail du verre, laissant un théâtre de ruines traversé d'une énergie tellurique.\",\"image_principale\":\"2014_07_17_installation_190_pelletier_ducret_glassfabrik_diorama_vdf2014_©marine_calamai(14).jpg\",\"creditphoto\":\"credits: Sandrine Pelletier / photo: Marine Calamai\",\"artiste\":\"Sandrine Pelletier\",\"latitude\":\"48.911944\",\"longitude\":\"5.386639\",\"titre\":\"Diorama\",\"url\":\"http://publicartmuseum.net/wiki/Diorama_(Sandrine_Pelletier)\"}");
