		obj = new JSONObject("{\"id\":\"4431\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Lahaymeix\",\"Sitenom\":\"Forêt communale de Lahaymeix\",\"mot_cle\":\"escalade\",\"hauteur\":\"1,84\",\"precision_materiaux\":\"peintures blanche et noire\",\"materiaux\":\"acier, métal, peinture\",\"couleur\":\"blanc, gris, noir\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Štefan Papčo compose une sculpture-rébus. Il déplace la codification usuelle des parois d'escalade, ouvre une voie de signes, un passage qui mène de la forêt meusienne aux mystères des falaises slovaques. L'architecture mentale de l'artiste-grimpeur est influencée par le nom de la voie qu'il emprunte, ici la neuvième : The Ninth Wave. Il fait découvrir un vocabulaire visuel peu connu des non-initiés et partage une expérience personnelle intense, une approche sensible du paysage, une acuité du rapport au temps et à l'espace propre aux adeptes de la haute montagne.\",\"image_principale\":\"2014_07_4_install_189_papco_ninth_wave_vdf2014_©marine_calamai.jpg\",\"creditphoto\":\"credits: Štefan Papco / photo: Marine Calamai\",\"artiste\":\"Štefan Papčo\",\"latitude\":\"48.929111\",\"longitude\":\"5.398528\",\"titre\":\"Ninth Wave\",\"url\":\"http://publicartmuseum.net/wiki/Ninth_Wave_(%C5%A0tefan_Pap%C4%8Do)\"}");
