		obj = new JSONObject("{\"id\":\"4430\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"mot_cle\":\"laine, arbre, tonte, toison\",\"precision_materiaux\":\"toisons de laine de moutons mérinos, grillage métallique, tiges filetées\",\"materiaux\":\"bois, laine, métal\",\"couleur\":\"blanc\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Yuhsin U Chang façonne la matière vivante, une sculpture d'épaisse laine brute, toison d'or sur le chemin de Champey. Elle dresse une impressionnante forme verticale de sept mètres de haut dont les volutes compactes émergent du paysage. Elles l'animent d'une énergie nouvelle, organique, d'une présence à la fois tangible et fantastique, porteuse d'un mystère en cours, d'une métamorphose à venir.\",\"image_principale\":\"2014_08_18_oeuvre_187_chang_intrusion_vdf2014_©marine_calamai(9).jpg\",\"creditphoto\":\"credits: Yuhsin U Chang / photo: Marine Calamai\",\"artiste\":\"Yuhsin U Chang\",\"latitude\":\"48.923917\",\"longitude\":\"5.457389\",\"titre\":\"Intrusion\",\"url\":\"http://publicartmuseum.net/wiki/Intrusion_(Yuhsin_U_Chang)\"}");
