		obj = new JSONObject("{\"id\":\"4429\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Pierrefitte-sur-Aire\",\"Sitedetails\":\"à la sortie du village, en direction de Nicey-sur-Aire\",\"Sitenom\":\"village de Pierrefitte-sur-Aire\",\"mot_cle\":\"chimères, alchimie\",\"materiaux\":\"fonte, métal\",\"couleur\":\"fer, gris, noir\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Jean-Marie Appriou explore tout à la fois les transformations intimes de la matière et un univers symbolique métissé et complexe. Il se réapproprie l'alchimie de la fusion de fonte, s'affranchit de ses pesanteurs traditionnelles et expérimente des techniques audacieuses. Sur un ancien bunker de Pierrefitte-sur-Aire, devant une haie de bouleaux, il cisèle une galerie iconoclaste issue du folklore populaire mêlant effrontément innocente patineuse, lames d'épée, animaux espiègles et satyre bucolique.\",\"image_principale\":\"Jean-Marie_Appriou_marie-aubépine_vdf2014_©marine_calamai.(3).jpg\",\"creditphoto\":\"credits: Jean-Marie Appriou / photo: Marine Calamai\",\"artiste\":\"Jean-Marie Appriou\",\"latitude\":\"48.897222\",\"longitude\":\"5.330028\",\"titre\":\"Marie-Aubépine\",\"url\":\"http://publicartmuseum.net/wiki/Marie-Aub%C3%A9pine_(Jean-Marie_Appriou)\"}");
