		obj = new JSONObject("{\"id\":\"4428\",\"proprietaire\":\"Vent des Forêts\",\"Sitepmr\":\"site non accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Dompcevrin\",\"Sitenom\":\"Forêt communale de Dompcevrin\",\"mot_cle\":\"arbre, racine, ruban de Möbius, symbiose mycorhizienne\",\"precision_materiaux\":\"racines, arbres, frêne, hêtre\",\"materiaux\":\"végétaux\",\"mouvement_artistes\":\"art in situ\",\"nature\":\"éphémère\",\"inauguration\":\"2014\",\"description\":\"Douglas White fouille une cavité inexplorée pour mettre à jour le système racinaire de deux grands arbres. Il révèle subtilement des interactions microscopiques et l'architecture des réseaux invisibles qui tissent la forêt. Par soustraction de l'humus, il rend visible sans le manipuler l'écheveau de racines, structure vivante qui apparaît à la surface en un tapis inextricable et fragile, matrice essentielle de la vie végétale d'un sous-bois.\",\"image_principale\":\"2014_07_22_installation_foret_192_white_enracine_vdf2014_©marine_calamai_(36).jpg\",\"creditphoto\":\"credits: Douglas White / photo: Marine Calamai\",\"artiste\":\"Douglas White\",\"latitude\":\"48.926222\",\"longitude\":\"5.443778\",\"titre\":\"Enraciné\",\"url\":\"http://publicartmuseum.net/wiki/Enracin%C3%A9_(Douglas_White)\"}");
