		obj = new JSONObject("{\"id\":\"3961\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"5e arrondissement de Paris\",\"Sitedetails\":\"entrée rue Cuvier\",\"Sitenom\":\"Campus de Jussieu\",\"longueur\":\"2,8\",\"hauteur\":\"9,6\",\"materiaux\":\"acier, inox\",\"contexte_production\":\"Pierre Manoli avait  étudié avec soin les impératifs techniques impliqués par le rôle fonctionnel et les dimensions importantes de l'oeuvre. Les quatre tonnes d’acier inoxydable poli nécessaires à sa réalisation ont été mises en œuvre directement sur place. Mesurant près de 10 mètres de haut, Cheminée, est ainsi composée de 10 tubes en acier inoxydable 18/10 portant 50 sphères qui servent de contreventement et sont soudées entre elles ou aux tubes. 35 sphères ont un diamètre de 40 cm, neuf de 60 cm, six de 72 cm.\",\"programme\":\"1% artistique\",\"nature\":\"pérenne\",\"inauguration\":\"1976\",\"description\":\"Cette sculpture monumentale, Cheminée, a été  commandée en 1975 à Pierre Manoli (1927-2001) lors de la construction de l’ensemble universitaire de la Halle aux vins de Paris. Les architectes (Cassan, Coulon, de Gortchakoff) avaient proposé d’associer l’intervention au titre du 1% à des installations utilitaires. Cette œuvre qui marque l’axe est-ouest , entre la rue des fossés St Bernard et la rue Cuvier, occupe une fonction technique en plus de sa vocation esthétique. En effet, ses lignes verticales sont des conduits d’où s’échappent les vapeurs du chauffage urbain, et du groupe électrogène.\",\"latitude\":\"48.8456524316732\",\"longitude\":\"2.3579849302768707\",\"titre\":\"Cheminée\",\"image_principale\":\"photo_0--1868116584.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--1868116584.jpg\",\"artiste\":\"Pierre Manoli\",\"url\":\"http://publicartmuseum.net/wiki/Chemin%C3%A9e_(Pierre_Manoli)\"}");
