		obj = new JSONObject("{\"id\":\"3860\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"longueur\":\"1,355\",\"hauteur\":\"3,515\",\"precision_materiaux\":\"bronze patiné\",\"materiaux\":\"bronze\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Baselitz, sculpteur, travaille exclusivement le bois à la hache ou à la tronçonneuse. Le caractère direct de cette technique lui permet d’exprimer autrement le radicalisme de son coup de pinceau. Mais depuis dix ans, Baselitz travaille étroitement avec la fonderie Noack, qui réalise des tirages de bronze à partir de ses bois. Ce bronze monumental est ici une douce parodie de la danseuse américaine Loïe Fuller, célèbre pour ses danses de voiles qu’elle faisait tournoyer dans ses chorégraphies.\",\"latitude\":\"48.8641708\",\"longitude\":\"2.3252044\",\"titre\":\"Louise Fuller\",\"image_principale\":\"photo_0-1127841022.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0-1127841022.jpg\",\"artiste\":\"Georg Baselitz\",\"url\":\"http://publicartmuseum.net/wiki/Louise_Fuller_(Georg_Baselitz)\"}");
