		obj = new JSONObject("{\"id\":\"3824\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitedetails\":\"L'œuvre est installée dans les jardins des Tuileries sur la terrasse, près de la galerie du jeu de paume.\",\"Sitenom\":\"Jardin des Tuileries\",\"materiaux\":\"bronze, granit\",\"contexte_production\":\"The Welcoming Hands est créée en 1996. Ele est acquise en 2000 par l'État français et installée cette année-là dans les jardins des Tuileries.\",\"nature\":\"pérenne\",\"inauguration\":\"1996\",\"description\":\"Il s'agit d'un ensemble de cinq sculptures en bronze représentant des mains et des bras nouées. Chaque sculpture repose sur un socle de granit.\",\"image_principale\":\"image-manquante.jpg\",\"creditphoto\":\"Voir atlasmuseum.net\",\"artiste\":\"Louise Bourgeois\",\"latitude\":\"48.865278\",\"longitude\":\"2.322778\",\"titre\":\"The Welcoming Hands\",\"url\":\"http://publicartmuseum.net/wiki/The_Welcoming_Hands_(Louise_Bourgeois)\"}");
