		obj = new JSONObject("{\"id\":\"3820\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"materiaux\":\"métal\",\"contexte_production\":\"Présenté par Marian Goodman, Paris, New-York\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Après « les archives du cœur » à coté de l’île de Naoshima au Japon et « les derniers jours de C.B. » en Tasmanie, Boltanski crée en octobre 2014 une nouvelle œuvre permanente située dans le désert d’Atacama au Nord du Chili. Cette série de pièces a simultanément, pour lui, valeur de mythe et de lieu de possible pèlerinage. En écho à cette grande installation chilienne, l’artiste présente aux Tuileries une œuvre dédiée aux étoiles. Des clochettes fixées au bout de longues tiges, plantées dans le sol et remuées par le vent, dessinent la carte du ciel vue depuis l’hémisphère sud la nuit du 6 septembre 1944. Le son des clochettes évoque alors la musique des astres et la voix des âmes flottantes.\",\"latitude\":\"48.862159010857\",\"longitude\":\"2.3290358483791\",\"titre\":\"Alma\",\"image_principale\":\"photo_0--2097895312.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--2097895312.jpg\",\"artiste\":\"Christian Boltanski\",\"url\":\"http://publicartmuseum.net/wiki/Alma_(Christian_Boltanski)\"}");
