		obj = new JSONObject("{\"id\":\"3813\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"contexte_production\":\"FIAC 2014\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Pour le Jardin des Tuileries, le duo installe Beautiful Tube #3, un 'white cube' rectangulaire suspendu aux branches d’un arbre. Cette pièce suggère un point de vue imaginaire et inaccessible, contrastant au sein de l’environnement de l’arbre, tout en oscillant en harmonie avec lui. La pièce évoque également l’artificialité des aménagements humains de la nature, en mobilisant une construction prenant place au cœur d’un cadre naturel.\",\"latitude\":\"48.86414762183151\",\"longitude\":\"2.324749678373337\",\"titre\":\"Beautiful Tube #3\",\"image_principale\":\"photo_0--1396734800.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--1396734800.jpg\",\"artiste\":\"Sabina Lang Daniel Baumann\",\"url\":\"http://publicartmuseum.net/wiki/Beautiful_Tube_%233_(Sabina_Lang_Daniel_Baumann)\"}");
