		obj = new JSONObject("{\"id\":\"3809\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitedetails\":\"Grand Bassin octogonal\",\"Sitenom\":\"Jardin des Tuileries\",\"autre_precision_etat_conservation\":\"L'œuvre semble reposer sous l'eau.\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Les nombreuses icônes qui parcourent l'œuvre de Jean-Luc Verna protéiforme sont à l’image des fées sulfureuses dont les baguettes magiques sont la trace. Ses sculptures sont le prolongement des symboles et éléments iconographiques qui parcourent ses dessins. Le caractère monumental des baguettes sont ainsi la manifestation dans le réel de ce télescopage magique des mondes dont Jean-Luc Verna rend les frontières poreuses.\",\"latitude\":\"48.86444860299581\",\"longitude\":\"2.3239704966545105\",\"titre\":\"Baguette magique\",\"image_principale\":\"photo_0--675400843.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--675400843.jpg\",\"artiste\":\"Jean-Luc Verna\",\"url\":\"http://publicartmuseum.net/wiki/Baguette_magique_(Jean-Luc_Verna)\"}");
