		obj = new JSONObject("{\"id\":\"3804\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"couleur\":\"beige\",\"nature\":\"pérenne\",\"inauguration\":\"2001\",\"latitude\":\"48.8656933\",\"longitude\":\"2.3248633\",\"titre\":\"Column\",\"image_principale\":\"photo_0--926411465.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--926411465.jpg\",\"artiste\":\"Tony Cragg\",\"url\":\"http://publicartmuseum.net/wiki/Column_(Tony_Cragg)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"3803\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"precision_materiaux\":\"Coffrage de tranchées\",\"contexte_production\":\"FIAC 2014/ Présentée par la Galerie Simon Lee, Londres, Hong Kong, New-York et Eva Presenhuber, Zürich\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Les caissons de tranchée, ou boîtes d’égout, sont utilisés pour protéger les travailleurs qui travaillent à l’intérieur des tranchées. Celles-ci ont un temps de resistance. Il s’agit du laps de temps entre le moment où une tranchée est creusée, jusqu’à ce que ces parois commencent à s’effondrer. Cette période peut varier de quelques minutes à plusieurs mois. Les travaux de tranchée sont mis en place essentiellement pour des aménagements souterrains comme creuser des lignes téléphoniques, des tuyaux, les fondations d’un bâtiment, mais aussi des fouilles archéologiques, peuvent être trés dangereux. Les caissons de tranchée sont ainsi placés afin de maintenir le vide. Les empiler les uns aux autres revient au même qu’architecturer le vide. Une tour de vides. Une colonne de vides.\",\"latitude\":\"48.86389808482487\",\"longitude\":\"2.330445349216461\",\"titre\":\"Void to Void\",\"image_principale\":\"B0iQmBFIMAEtfuY.jpg\",\"creditphoto\":\"credits: source: https://twitter.com/StayfanChemin\",\"artiste\":\"Leander Djønne\",\"url\":\"http://publicartmuseum.net/wiki/Void_to_Void_(Leander_Dj%C3%B8nne)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"3799\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitedetails\":\"FIAC 2014\",\"Sitenom\":\"Jardin des Tuileries\",\"longueur\":\"10,7\",\"hauteur\":\"5,2\",\"precision_materiaux\":\"Bois épicéa\",\"materiaux\":\"bois\",\"contexte_production\":\"Présentée par la galerie Mitterrand, Paris, pour la FIAC 2014. Œuvre réalisée avec le soutien des charpentiers de Paris\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"Les Frères Chapuisat développent une œuvre qui relève autant de la sculpture monumentale que de la micro-architecture. Leurs installations confrontent les visiteurs à une double expérience : d’abord frontale, les œuvres agissent comme des sculptures aux dimensions souvent spectaculaires, puis intérieure, elles invitent à entrer dans les constructions pour éprouver des sensations ambigües. Ses structures évoquent des rêves, des peurs ou des expériences de l’enfance, et affirment une convergence entre l’art et la vie. Magna Mater fait ici référence à la divinité Cybèle d’origine phrygienne, qui personnifie la nature sauvage. A la fois contrepoint massif de la pyramide du Louvre et aire de jeux en bois s’intégrant au cadre du jardin, cette installation associe architecture sacrée et instinct ludique.\",\"latitude\":\"48.86478\",\"longitude\":\"2.3233016\",\"titre\":\"Magna Mater\",\"image_principale\":\"photo_0--1355503752.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--1355503752.jpg\",\"artiste\":\"Les Frères Chapuisat\",\"url\":\"http://publicartmuseum.net/wiki/Magna_Mater_(Les_Fr%C3%A8res_Chapuisat)\"}");
		data.put(obj); nbentries++;
		obj = new JSONObject("{\"id\":\"3797\",\"Sitepmr\":\"site accessible aux personnes à mobilité réduite\",\"Sitepays\":\"France\",\"Siteregion\":\"Île-de-France\",\"Siteville\":\"1er arrondissement de Paris\",\"Sitenom\":\"Jardin des Tuileries\",\"materiaux\":\"marbre\",\"couleur\":\"blanc\",\"contexte_production\":\"FIAC 2014\",\"programme\":\"FIAC 2014\",\"nature\":\"éphémère\",\"inauguration\":\"23 octobre 2014\",\"description\":\"En usant d’humour, d’ironie et de mélancolie, son travail se déploie par l’usage des médias digitaux et par le riche potentiel offert par les nouvelles technologies. Il s’inscrit pourtant dans un héritage classique de la fonction de l’artiste, devant représenter l’impossible. Il poursuit cette quête en utilisant des logiciels de création 3D qui lui permettent de réaliser ces sculptures de marbres taillées au laser. Si l’artiste a déjà créé, grâce à ce processus, plusieurs bustes, il présente pour la première fois une production monumentale de deux sculptures. C’est avec grâce et poésie que Rafman poursuit l’utopie de l’artiste démiurge produisant des formes impossibles et parfaites.\",\"latitude\":\"48.86324772780664\",\"longitude\":\"2.328987568616867\",\"titre\":\"New Age Demanded\",\"image_principale\":\"photo_0--356096816.jpg\",\"creditphoto\":\"http://publicartmuseum.net/wiki/Fichier:photo_0--356096816.jpg\",\"artiste\":\"Jon Rafman\",\"url\":\"http://publicartmuseum.net/wiki/New_Age_Demanded_(Jon_Rafman)\"}");
