		obj = new JSONObject("{\"id\":\"1704\",\"Sitepays\":\"France\",\"Siteregion\":\"Lorraine\",\"Siteville\":\"Phlin\",\"Sitenom\":\"Lavoir de Phlin\",\"proprietaire\":\"Commune de Phlin\",\"precision_materiaux\":\"bois, béton, métal\",\"materiaux\":\"bois, béton, métal\",\"contexte_production\":\"Action Nouveaux commanditaires de la Fondation de France\",\"programme\":\"Commande publique\",\"nature\":\"pérenne\",\"description\":\"Le lavoir, construit en 1852, a été remis en eau à la faveur de la commande, en hommage aux lavandières d'autrefois. L'installation est faite de 3 cercles concentriques et en écho aux 3 phases de la lessives : le lavage, le rinçage et le séchage. Un banc en bois entoure le bassin. Il est gravé des signatures des 50 habitants de la commune - en souvenir d'une caisse en bois appelée 'le carosse' recouverte des noms des habitants qui contenait de la paille pour poser les genoux. Le bassin où l'eau coule rappelle le travail des lavandières. Au centre du bassin, une plaque rouge circulaire laisse échapper 3 sifflets de vapeur à l'arrivée d'un visiteur comme pour l'inviter à devenir acteur du lieu. A la tombée de la nuit, 9 lumières semblent réveiller l'esprit du site.\",\"latitude\":\"48.91137\",\"longitude\":\"6.27705\",\"inauguration\":\"1999\",\"titre\":\"Le Lavoir de Phlin\",\"image_principale\":\"3P05355.jpg\",\"creditphoto\":\"credits: Raoul Marek (© Adagp, Paris) / photographe : Laurent Lecat\",\"artiste\":\"Raoul Marek\",\"url\":\"http://publicartmuseum.net/wiki/Le_Lavoir_de_Phlin_(Raoul_Marek)\"}");
