		obj = new JSONObject("{\"id\":\"2970\",\"Sitepays\":\"France\",\"Siteregion\":\"Poitou-Charentes\",\"Siteville\":\"Niort\",\"Sitedetails\":\"Rue Ricard et rue Victor-Hugo\",\"proprietaire\":\"Ville de Niort\",\"precision_materiaux\":\"Bronze, marbre, glassphalt (enrobé mêlé d'éclats de verre pilé)\",\"materiaux\":\"bronze, glassphalt, marbre\",\"contexte_production\":\"Réalisé dans le cadre d'un aménagement en centre-ville\",\"programme\":\"commande publique\",\"nature\":\"pérenne\",\"description\":\"Mobilier urbain dont la fonctionnalité se double d'une représentation symbolique puisant ses sources dans l'histoire locale. Rue Ricard, quatre dragons, réminiscences d'une légende du 17ème siècle faisant état d'un tel animal vivant dans le Marais Poitevin, ondulent à la surface et assurent une transition entre l'esplanade accessible aux voitures et les rues adjacentes réservés aux piétons, rue Victor-Hugo, des mâts vénitiens rebaptisés 'bricoles' servent à visualiser les places de stationnement en épis, des citations littéraires au sol, des dalles obliques sur lesquelles s'écoule un film d'eau, enfin un parking à vélos et des appuis possibles pour les promeneurs autour des arbres, rythment le parcours. Le revêtement au sol en glassphalt, le soir, donne un effet de brillance comme une surface d'eau d'où émergeraient les dragons\",\"latitude\":\"46.323835\",\"longitude\":\"-0.460636\",\"inauguration\":\"1992\",\"titre\":\"Sans titre\",\"image_principale\":\"N1_Hondelatte-Jacques_1.jpg\",\"creditphoto\":\"credits: © Jacques Hondelatte\",\"artiste\":\"Jacques Hondelatte\",\"url\":\"http://publicartmuseum.net/wiki/Sans_titre_(Jacques_Hondelatte)\"}");
